(25, 'Food & Beverage', 'Food-Beverage', '1609148420.png', 1, 2, 'Cereals, Food Grains, Dairy Products, Bakery & Confectionery Products, Beverages, Spices, Food Products - Manufacturers', '<p>cereals, food grains, dairy products, bakery &amp; confectionery products, beverages, spices, food products, preserved foods, frozen foods, soft drinks, manufacturers, suppliers, wholesalers, dealers, traders, exporters</p>', '<p>Online business directory of food products manufacturers, beverages manufacturers, bakery products exporters, spices manufacturers, foods grains suppliers, wholesale cereals suppliers, wholesalers, traders and exporters. Get companies manufacturing foods, beverages, soft drinks, spices, seasonings, bakery products, confectionery products, snacks, and more.</p>', 'no'),
