(7, 'About Us', '<h2 style=\"color:#000000;font-weight:bold;\">About Us</h2>\r\n\r\n<p>Venicered.com is India\'s leading and largest B2B E-Commerce platform started and operated by Venice Red India Private Limited. We have been serving an infinite number of customers with more than thousands of service professionals along with hundreds of categories. We provide a secure and convenient platform for your business with our professional and skilled staff. We are the first-ever B2B portal that works with the latest and advanced technology. \r\nWe are a 360° digital marketing platform that connects buyers and sellers digitally with an objective of automated and online commerce. \r\nVenice Red provides end to end service for all the SMEs and MSMEs; we are the first to offer such services and facilities. Our primary work is to help and guide you in running your business. </p>\r\n\r\n<p>Venice Red provides the following services to all the businesses.</p>\r\n\r\n<p>\r\n<span style=\"color:#000000;font-weight:bold;\">B2B:</span> Venice Red is a vast platform for a B2B business, it is the business directory where one can easily find all the products in more than 200 categories. Wholesalers and retailers can easily communicate with each other and conduct their business digitally.</p>\r\n\r\n<p><span style=\"color:#000000;font-weight:bold;\">E-Filing:</span>If you want to get GST, PAN card, Income Tax returns, or any of such services, Venice Red can easily provide you all these services. We are a 360-degree portal where we offer all the facilities that are required to run a business.</p>\r\n\r\n<p><span style=\"color:#000000;font-weight:bold;\">Jobs:</span>We also provide employees for your business, we work as a job consultant and bring out the best and experienced people. Our work is to match and connects the candidate to the vacant job positions. </p>\r\n\r\n<p><span style=\"color:#000000;font-weight:bold;\">Distributorship:</span>Venice Red has a distributorship chain, after the business deal, we provide the distributorship service for the clients wherever they want. We have various distributors all around that will deliver you the product within the time or even before.</p>\r\n\r\n<p>We work to promote our user\'s profile and ensure that they should be known by their name itself, so you can easily foster your product and services with us. We are the one roof platform for all manufacturers, traders, wholesalers, distributors, exporters, importers, suppliers, where they can run and conduct their business effectively. We are the only B2B platform that helps you to survive in this competitive market and make you a brand; we have already helped a large number of enterprises to become a brand all across the globe. Along with B2B marketing, we also focus on branding and social media promotion. We are the most trustworthy portal that fulfills all the needs of the customers. Venice Red India Private Limited is the complete solution to all your business problems; we are the complete B2B directory of all the products and services across the globe.</p>\r\n\r\n<p style=\"color:#000000;font-weight:bold;\">Mission</p>\r\n<p><span style=\"color:#000000;font-weight:bold;\">“WE MAKE BRAND”.</span> Venice Red India Private Limited focuses on branding your business and promoting you as an individual enterprise. We provide safe and reliable business to all the members who are connected with us.</p>\r\n\r\n<p style=\"color:#000000;font-weight:bold;\">Vision</p>\r\n<p>We work for the growth and development of your business.\r\n Further, we want your business to be completely digital. Venice Red India Private Limited is the supreme B2B E-commerce stage and will continue to be the same in the coming future.</p>', 'About-Us', 0, 1, 1, 1),
(12, 'Terms and Conditions', '<p><strong>Terms &amp; Conditions</strong>\n</p>\n\n<p>1.\"Company\" means \"Venice Red India Pvt. Ltd.\" and includes Venicered.com where the context so requires.</p>\n\n<p>2.\"Advertiser\" means the person or seller, company or other entity that wishes to advertise and avail of the services provided by the Company and whose name is set forth adjacent to the term \"Advertiser\" appearing overleaf.</p>\n\n<p>3.The rates mentioned herein are applicable for this transaction alone. The Company will have the right to change the advertising rates at any given point of time. without notice </p>\n\n<p> 4.All advertising material (collectively \"Advertisement\") supplied by advertiser to the Company should either be owned by or be legally authorized for use by the Advertiser. The Advertisement must not be obscene, offensive or unlawful in any manner and should not contravene any applicable laws, rules and/or regulations.</p>\n\n<p>5. The Company \"Venice Red India Pvt. Ltd.\" will have the sole discretion, at all times, to reject the Advertisement and further does not guarantee any particular position or place in the directory/website for the display of the Advertisement.</p>\n\n<p>6. The Company will take every reasonable precaution to publish the information, as supplied by the Advertiser, in the directory. However, the Company will not be responsible in case of any errors or omissions. But company is committed to edit/correct the errors or omissions and when he same is communicated by the adviser  in writing wherever changes are possible.</p>\n\n<p>7. The Company reserves the right to make any modifications, if considered necessary or desirable in an Advertisement.</p>\n\n<p>8. Unless the Company and the Advertiser otherwise agree in writing, the Advertisement (excluding the trademarks and/or trade name of the Advertiser) used in preparation of the artworks will be the exclusive property of the Company. The Advertiser hereby warrants that the artwork design by the Company in any of its publications will not be reproduced or assigned for reproducing as a whole or in part, without the prior written consent of the Company.</p>\n\n<p>9. Advertising agency involved in placing the Advertisement for and on behalf of any person, company or entity (\"Ultimate Customer\") assures that it has the authority to modify and/or amend an Advertisement of an Ultimate Customer, in accordance with Advertiser\'s instructions without committing any offence or tort. The Advertiser hereby warrants and agrees that it shall indemnify and hold the Company harmless to the extent of any costs, damages or other charges falling upon the Company as a result of any claim and/or dispute raised by the Ultimate Customer against the Company arising from or relating to publication of the Advertisement.</p>\n\n<p>10. The Advertiser hereby represents and warrants that:\n1. he is the owner of products and/or services that he wants advertised; and/or</p>\n\n<p>2. Is duly authorized by the owner to use the Advertisement related copy cuts and illustration(s) and any trademarks &amp; trade name which may be specified for use in the Advertisement.</p>\n\n<p>11. The Advertiser hereby agrees to notify the Company in writing of any change in ownership or authorization as aforesaid, which occurs after the execution of this invoice.</p>\n\n<p>12. The Advertiser hereby agrees to defend at its own, indemnify and keep the Company harmless from any infringement claims, losses and judgments which arise from or which are claimed to have arisen from the use of such copy cuts, illustrations, marks and names and Directories, the Advertisement and/or any Advertisement related material including but not limiting to any third party infringement claims together with expenses, attorney fees and court costs incurred by the Company.</p>\n\n<p>13. The Advertiser assumes sole responsibility and liability for protection of its Intellectual Property right(s) in any writing, pictorial illustration design format, photograph or combination thereof included in the Advertisement.</p>\n\n<p>14. Under no circumstances shall the Company or its associates be liable for any direct, indirect, incidental, special, consequential or exemplary damages, (even if the Company has been advised of the possibility of such damages) resulting from or in connection with the use of by the Advertiser of any of Venicered\'s services, including but not limiting to, damage(s) for loss of profits, goodwill, use, data or other intangible losses. Such limitation shall also apply with respect to damages incurred by reason of other services or products received through or advertised in connection with the Company, regardless of any negligence arising out of any of its services.</p>\n\n<p>15. Without prejudice to the aforesaid, the Company\'s liability under any circumstances is limited to the amount of fees, if any, paid by the Advertiser to the Company.</p>\n\n<p>16. In the event of any dispute between the Advertiser and the Company under, in connection with or in relation to this invoice, the same will be adjudicated by the courts of competent jurisdiction at Noida only, and in exclusion of all other courts that may have jurisdiction in the matter.</p>\n\n<p>17. This invoice shall be governed and construed in accordance with the laws of India without reference to its conflict of laws principles.</p>\n\n<p>18. In addition to the terms and conditions set forth in the invoice, and unless repugnant to the meaning or context thereof, the Advertiser hereby agrees and acknowledges that the User Agreement/Terms and Conditions, as reproduced on the Venicered.com website \'Venicered.com\' (\"T &amp;Cs\") are applicable to this invoice and are deemed to be incorporated herein by reference. In the event of any conflict or inconsistency between this invoice and the \"T &amp; Cs\", the latter shallprevail.</p>\n\n<p>19. All correspondence to the Advertiser shall be sent to the address set forth overleaf and all correspondences to the Company should be addressed to our Registered Office.</p>\n\n<p>20. In case, due to whatever reason(s) if any advertiser asks for cancellation of advertisement(s), 35% of the amount paid will be deducted by the company as cancellation charge. Additionally ,on pro-rata basis deductions from the total amount paid by the advertiser will be done as per the consumption of advertisement based on the live duration of the given advertisement vis-a-vis total period booked.	</p>\n\n<p><strong>USER AGREEMENT</strong></p>\n\n<p>Defined Terms\nUnless repugnant to the subject or context, the words appearing herein below shall have the meanings as set forth below:</p>\n\n<p>1.\"Agreement\" shall mean this User Agreement and shall include the User application form duly completed, its attachment(s) and the terms and conditions stated herein and includes the documents incorporated by reference including the Illegal/Prohibited Content, Disclaimer, Warning against Fraud, Contract Form/Bill terms and conditions and such other documents that Company may in its absolute discretion add to the Site from time to time. It shall be deemed to have been executed at New Delhi.</p>\n\n<p>2. \"Banner\" means a service offered to a User wherein a graphic image is placed on the Site and used to advertise the product(s) and/or service(s) of the User and this graphic image is linked to the User\'s own website.</p>\n\n<p>3.\"VR Trust Certificate\" means The Company uses several tools and techniques to verify the accuracy of the given information by its registered Users. For the comfort of Users, Company offers the VR Trust certificate tool (3rd party verified report) which provides Users with more authentic information about a listed company (wherever applicable). We encourage Users to use VR Trust Certificate   tool available on the Site, as well as business sense, to evaluate with whom the User is dealing. However, in no event shall the Company be liable for any direct, indirect, incidental, punitive, or consequential damages of any kind whatsoever with respect to the offered tool, services and/or the contents thereof. The Company hereby specifically disclaims any liability on account of a User\'s reliance upon any content.</p>\n\n<p>\"Company\" means Venice Red India Pvt. Ltd.,  registered office at C-125, GROUND FLOOR, SECTOR 2 NOIDA Gautam Buddha Nagar UP 201301 IN, along with its unit for the Company\'s website called venicered.com and where the context so requires, means and includes all Venice red India Pvt. Ltd.\'s officers, directors, employees and subsidiary, associate and affiliate entities, and/or business entities with whom Venice Red India Pvt. Ltd. enters into a partnership or strategic or financial alliance.</p>\n\n<p>\"Credit Report\" is a third party paid service provided to a User to obtain information about another company or legal entity, including detailed analytical information about profitability, past and present trading analysis and ownership essentially with a view to analyze their credit rating and stability.</p>\n\n<p>\"Customized Header Catalog\" is a subtype of On-line Catalogs that allow the customer to have catalog designed to his taste, however the functionalities available on the Catalog are fixed and are a part of the standardized offering.</p>\n\n<p>\"Customized Websites\" is a platform for Users to showcase their products or services on the Site.</p>\n\n<p>\"Date of Termination\" means the date when the User\'s subscription comes to an end. It shall be specified by the Company in its notice to the User either through e-mail or conventional mail.</p>\n\n<p><strong>Agreement between User and Company</strong></p>\n\n<p>The User understands that the Company through the Site provides hosting services to its Users. All Content listed on the Site is third party User generated content which is transmitted and/or hosted on the Site. Company neither originates nor initiates the transmission nor selects the sender and receiver of the transmission, nor modifies the information contained in the transmission.</p>\n\n<p>The Site is operated by Venice Red India Pvt. Ltd. and its affiliates/associates. The Services are offered to the User conditioned on the acceptance of the User without modification of the terms, conditions, and notices contained herein. Use of the Site by a User constitutes agreement to all such terms, conditions, and notices. If the User does not agree with any part of the Agreement, these terms, conditions and notices, it/they must not use the Services.</p>\n\n<p>Most content and some of the features on the Site is made available to Users free of charge. However, Company reserves the right to terminate access to certain areas or features of the Site to Users at any time with or without giving any reason, with or without notice. Company also reserves the universal right to deny access to particular Users to any/all of its Services and/or content without any prior notice/explanation in order to protect the interests of Company and/or other visitors to the Site. Company reserves the right to limit, deny or create different type access to the Site and its content features with respect to different User(s), or to change any of the features or introduce new features without prior notice.</p>\n\n<p>Company reserves the right to list its registered Users on the Site and as well as on other network portals run by the Company. In case a User does not want to be listed on the Site or on any of our network portals, they can communicate the same to us in writing by sending an email to info@venicered.com</p>\n\n<p>Users are advised to exercise due caution while transacting with a prospective buyer or a seller on the Site. Users must undertake interaction or transaction with organizations and/or individuals located on or through the Site, with reasonable caution and after undertaking thorough diligence on such organization and/or individual. Neither the Company nor its director’s, employees, officers or agents shall be liable to any User or otherwise, for any illegal or fraudulent interaction or transaction with organizations and/or individuals located on or through the Site.</p>\n\n<p><strong>WARNING AG AINST FRAUD:</strong></p>\n\n<p>                                                                  FRAUD WARNING\nAll Users are advised to be very careful while doing business with individuals, body corporates or companies from any part of the world.\nUsers are advised to exercise due caution while transacting with a prospective buyer or a seller on the Site. Users must undertake interactions or transactions with organizations and/or individuals located on or through the Site, with reasonable caution and after undertaking thorough diligence on such organization and/or individual. Neither the Company nor its director’s, employees, officers or agents shall be liable to any User or otherwise for any illegal or fraudulent interaction or transaction with organizations and/or individuals located on or through the Site.\nUsers are advised to not send any advance money/legal fee or products unless there is cash in your account or an irrevocable letter of credit from the buyer, duly authorised by the buyer’s bank.\nUsers are advised not to transact business unless full payment is made to you before shipping of the products.\nCREDIT CARD SCAMS - When a User receives any online Order paid by Credit Card, it is recommended that you ask for a written Credit Card Authorisation to be faxed to you. Please get validity of the Credit Card checked with your Bank or contact VISA, Master Card or American Express directly. Unless the validity of the Credit Card is confirmed, please do not ship any goods.\nBANK DRAFT SCAMS - BANK DRAFT SCAMS - There have been cases of people receiving Bank Drafts with unauthorised printing of Bank Names. Before shipping any product or advancing a partial cash advance, you must wait for the Bank to clear the Bank Draft/Check.\nRegistration/License/Tender Fee SCAMS - Cases have been reported where an offer is sent to buy a large number of goods after the seller pays them a Registration/License/Tender Fee. They post Offers to BUY large quantity of Computers and other material. Once you submit your bid; you will be notified that your Tender has been accepted. You will then be asked to pay for Legal fees and Tender Fee. DO NOT PAY ANY FEE. Don\'t ship any Computers/Other products unless you have the cash in your account confirmed by your bank.</p>\n\n<p>This document is an electronic record in terms of the Information Technology Act, 2000 and the provisions pertaining to electronic records in various statues amended by the Information Technology Act, 2000.</p>\n\n<p><strong>DISCLAIMER</strong></p>\n<p>Company as well as its management have created these pages and the Services as a specific feature and as a service to the global exim community.</p>\n\n<p>No warranty or condition expressed or implied or statutory is being provided to the User. Company hereby specifically disclaims any quality, durability, accuracy, reliability and all express or implied warranties including but not limited to warranties of title, merchantability, fitness for a particular purpose or performance. Company does not make any representation or warranties of any kind about any product or Services offered, or displayed or hosted on the Site. All such warranties, representations, conditions and undertakings are hereby excluded.</p>\n\n<p>Under no circumstances shall Company be held liable for any delay or failure or disruption of the content or services delivered through the Site resulting directly or indirectly from acts of nature, forces or causes beyond our reasonable control, including without limitation, internet failures, computer, telecommunications or any other equipment failures, electrical power failues, strike, labor disputes, riots, insurrections, civil disturbances, shortage of labor or materials, fires, flood, storms, explosions, acts of God, war, governmental actions, order of domestic or foreign courts or tribunals or non-performance of third parties or other force majeure condition.</p>\n\n<p>Listing of counterfeits, non-licensed replicas or unauthorized products is strictly prohibited on the site. Further no products can be advertised on the site without the explicit permission from the intellectual property right holder. It is clear inter-alia that all third party intellectual property rights are owned by the third party and not Venice Red India Pvt. Ltd./its users.\nUnder no circumstances will Company be liable, direct, indirect, incidental, special, consequential or exemplary damages including but not limited to, damages for loss of profit, goodwill, use, data or other intangible losses arising out of or in connection with the use of the Services provided by Company (“Damages”) whether arising out of or in connection with or otherwise in relation to any business or other transaction conducted in relation to the Service(s). The Company’s liability is limited in any and all circumstances shall be limited to the lesser of the amount of fees and/or charges paid by the User or Rs. 10,000/- (Indian Rupees Ten Thousand)</p>\n\n<p>The User hereby indemnifies and holds Company harmless against any and all losses, claims, injuries and Damages that may arise out of the User’s breach of this Disclaimer and/or the Agreement, Illegal/Prohibited Content, Warning against Fraud and or any breach of the terms and conditions or the representations or warranties made by the User herein or in the Agreement/usage terms.</p>\n\n<p>Company reserves the right to change the nature of the paid Services offered here or discontinue its Services to a member without any prior notice.</p>\n\n<p>This document is an electronic record in terms of the Information Technology Act, 2000 and the provisions pertaining to electronic records in various statues amended by the Information Technology Act, 2000.</p>', 'Terms-and-Conditions', 0, 1, 3, 1),
(13, 'Privacy and Policy', '<h2><strong>Privacy Policy</strong></h2>\r\n\r\n<p>1. This privacy policy of VENICERED.COM is applicable to all confidential personal information that is collected on the site. In this policy, the site highlights how and why we tend to collect all relevant and accurate personal information and how we make use of it.</p>\r\n\r\n<p>2. VENICERED.COM is dedicated to comply with legislations of governing privacy of confidential personal information by business and protects all your privacy in the best possible manner when you make deals with us.</p>\r\n\r\n<p>3. Personal information collected from different people so that if you contact us for any issue, query, we keep complete record of that correspondence in the best effort basis. It can helps us to find solution and do root cause analysis of any issue or query raised by you.</p>\r\n\r\n<p>4. The personal data collected by us is a step to make you aware of who we are, we also allow you to gain access to information held about you.</p>\r\n\r\n<p>5. Use of information collected and disclosure of personal information to others. We might use or disclose any personal information that is held about an individual’s primarily for the purpose which it is collected. Such information may be collected for a purpose of maintaining records. The information is not disclosed to unwanted people. The information here is disclosed to people outside the periphery of our business in the situations set out in this policy or otherwise notified to you at the time of collection of the data.</p>\r\n\r\n<p>6. When we suspect an unlawful action or may be engaged in or has been a part of the disclosure, it becomes important for us to investigate and report the matter to the relevant authorities.</p>\r\n\r\n<p>7. When such disclosure is must under authorized law</p>\r\n\r\n<p>8. Where we believe that the use of the revelation is essential for the refrainment, investigation, punishment and prosecution of crimes or wrongdoings for conduct of proceedings afore any court or tribunal for the implementation of the order of the court or tribunal by the enforcement body.</p>\r\n\r\n<p>9. Website may contain links of other websites and those of third parties that may collect personal information about you in which we are not liable in any manner. We are not at all responsible for the private practices of other businesses or the data on the websites that are linked to our websites. We on our platform encourage users to stay aware when they leave the site and read the privacy statements of each and every linked website.</p>\r\n\r\n<p>10. Our platform places a great emphasis on the security of the information that is associated with our customers and contractors. We have complete security measures that protects against loss, alteration and misuse of any personal information that is under our control.</p>\r\n\r\n<p>11. Personal information is to be de-identified or to be destroyed securely when no longer required by us.</p>\r\n\r\n<p>12. The VENICERED.COM retains the information you dole out to us and comprises your contact and all credit details to ensure us that you verify transactions and customer details for adequate records for legal and accounting purposes.</p>\r\n\r\n<p>13. All the major information stored with our computer can only be accessed by trust worthy authorities.</p>\r\n\r\n<p>14. No data ought to be transmitted over digital world is 100 per cent secured. While we ensure to protect all personal information of yours, but anything transferred over internet or via online means of communication we don’t provide warranty or guarantee in that case. The VENICERED.COM receives your transmission and makes effort to ensure its security on its systems.</p>\r\n\r\n<p>15. Finally users are solely responsible for keeping their passwords or any form of account information secret. You ought to be careful and responsible whenever you are online. You must not share your password with any one for safety and you shall be solely responsible for keeping privacy of your account.</p>\r\n\r\n<p>16. Access to and correction of personal information We at VENICERED.COM are dedicated to maintain authentic and accurate information of our customers in the best possible manner.</p>\r\n\r\n<p>17. we will provide you with the access to that information. if it is required by compliance.</p>\r\n\r\n<p>18. You shall be solely responsible for any inaccurate information provided by you , we are not liable for any inaccurate information given by you.</p>\r\n\r\n<p>19. Complaints: If you have any complaints Email us at complaints@VENICERED.COM, support@VENICERED.COM or Submit at https://www.VENICERED.COM</p>\r\n\r\n<p>20. Contacting us: If you need any information please contact us at the following address: E-mail: support@VENICERED.COM</p>\r\n\r\n<p>21. Acceptance: You accept that your use of this site includes your acceptance of this Privacy Policy and the Terms of Use</p>\r\n\r\n<p>Refund / Money Back Policy</p>\r\n\r\n<p>Once subscribed &amp; the paid services activated on VENICERED.COM, the payment made by the User for activated Paid service is not refundable under any circumstances and no claim for refund would be entertained. VENICERED.COM neither offers any guarantees for the accuracy, timeliness, authenticity nor advocates any of the content posted by the other Users. All the services are on a best effort basis.</p>\r\n\r\n<p>VENICERED.COM neither offers any guarantees for the accuracy, timeliness, authenticity nor advocates any of the content (Inquries, Product Listing, Catalog) posted by the other Users. All the services are on a best effort basis. So Under any circumstances VENICERED.COM is not liable to refund.</p>\r\n\r\n<p>VENICERED.COM shall not be liable in the event of any miscommunication between the client and the Sales Agent (Business Consultant). VENICERED.COM neither offers any guarantees for Business Deal &amp; Return on Investment All the services are on a best effort basis where our team try to give best business opportunities through platform advertising. No refund shall be initiated at any kind of circumstances with regard to the services already activated. So Before doing anything Please understand &amp; read all the Policy / Terms &amp; Condition / Subscription everything on VENICERED.COM. For further confirmation Please get written confirmation only from support@VENICERED.COM</p>\r\n\r\n<p>VENICERED.COM does not represent the seller or the buyer in transactions and does not charge any commission for enabling any transaction. VENICERED.COM does not control and is not liable to or responsible for the quantity, quality, safety, lawfulness or availability of the products or services offered for sale on the Web Site or the ability of the suppliers to complete a sale or the ability of buyers to complete a purchase. User(s) are cautioned that there may be risks of dealing with foreign nationals or people acting under false pretences on the Web Site. Web Site uses several tools and techniques to verify the accuracy and authenticity of the information provided by User(s). VENICERED.COM however, cannot and does not confirm each User(s)’s purported identity on the Web Site. VENICERED.COM encourages User(s) to evaluate the User(s) with whom they would like to deal with and use the common prudence while dealing with them. So Under any kind of circumstances VENICERED.COM is not liable to refund.</p>', 'Privacy-and-Policy', 0, 1, 4, 1),
(14, 'Career', '<h2><strong>Career With Us</strong></h2>\r\n\r\n<p>Being a B2B portal, Venice Red has a lot of jobs to offer. We are the fastest growing organization and we are looking for a highly creative candidate. We need highly experienced professionals that are best in their field. Along with the subject knowledge we want you to be creative and dedicated regarding the work. We also need fresh talents that must be aware of all the latest marketing trends and techniques. The candidate must be full of enthusiasm to learn new things and roll out with creative and innovative ideas. He/she must coordinate with all other employees and have the capability to face new challenges now and then. Moreover, the candidate must take all the responsibilities and complete all the tasks before or within the deadline. Just meet all the above mention requirements and join the family of Venice Red.</p>\r\n\r\n<p><strong>How to Apply</strong></p>\r\n\r\n<p>For any of the above mention designation, just write us for the designation you are applying along with your latest resume at Info@Venicered.com. </p>', 'Career', 0, 1, 3, 1),
(15, 'FAQ', '<h2>What is a B2B E-Commerce portal? </h2>\r\n\r\n<p>A B2B E-Commerce portal is a digital platform where buyers and sellers communicate and conduct their business 24/7.  The primary focus of a B2B portal is to run the business much securely and conveniently across the globe.</p>\r\n\r\n<p>Why should you go for a B2B portal?</p>\r\n\r\n<p>An E-Commerce B2B portal gives you a secure and versatile platform where you can easily conduct your business. It will increase your reach and sale; also you get the opportunity to expand your business in this competitive market.</p>\r\n\r\n<p> How to choose a B2B e-commerce portal?</p>\r\n\r\n<p>You should look out for the following factors before choosing a good portal. Investment - Amount that you will have to invest from building a website to developing and maintaining it. Growth - It is about the growth of your business (time and expansion). Reach - The area in which you want to run your business.</p>\r\n\r\n<p>Difference between a B2B portal and an inbound marketing agency?</p>\r\n\r\n<p>To some context they are similar, but a B2B portal is more explored in terms of sales compared to inbound marketing companies. They focus on branding your business in addition to bringing leads and help you in growing your business in every aspect.</p>\r\n\r\n<p>Why to choose Venice Red India Private Limited?</p>\r\n\r\n<p>Venice Red India Private Limited is one of the leading B2B E-Commerce Platform in India. We promote and advertise your business rather than ours, from website development to maintaining we focus on all the areas that will help you to increase your business. Our skilled and professional staff work with trending market techniques and bring out the best and creative results for you.</p>\r\n\r\n<p>What are the benefits of choosing Venice Red India Private Limited?</p>\r\n\r\n<p>We Venice Red India Private Limited offers a vast platform to gradually grow your business, we focus on branding your business and promoting on all the social media platform like Face book, Instagram, Twitter, YouTube and so on. You get a secure and convenient stage to boost your business and achieve a milestone in the market.</p>\r\n\r\n<p>How can I connect to Venice Red India Private Limited?\r\n website:       https://www.venicered.com/ \r\n Contact Us: 18008893978\r\n Email:           amit@venicered.in</p>', 'FAQ', 0, 1, 5, 1);
