INSERT INTO `post_steps` (`id`, `post_id`, `step_name`, `step_image`, `step_description`, `created_at`, `updated_at`) VALUES
(5, 19, 'Universal Marketing', 'jcxGresxuWzXpIDCYMkKE0sFH2K8Qo-1603881792.jpg', '<p>Online marketing serves you with the advantage of marketing your product and services 24 into seven all around the world. Just with a few months of SEO strategies, one can easily capture millions of viewers and customers all over the universe. Online marketing also provides real-time data and offers customer feedback. You and your customers can contact each other at any time at any place. If you are a traditional marketing user and looking forward to stepping into online marketing, contact <a href=\"https://www.venicered.com\" target=\"_blank\">www.venicered.com</a>, and enjoy our services to make your business entirely digital. Venice Red is a B2B portal that connects buyers and sellers digitally.</p>', '2020-10-21 07:04:02', '2020-11-17 10:27:10'),
(6, 19, 'Proximity (Target audience)', '5J99jkW1cJnwE8EDcuUudrELdZDgDX-1603881831.jpg', '<p>Online retailing comes with the most advanced feature of targeting the audience based on the location, irrespective of any boundary. It allows you to select the audience according to your product and services. During traditional or mass marketing, it was hard to select the audience but online marketing gives a marvelous feature of selecting the target audience all across the globe.&nbsp;</p>', '2020-10-21 07:07:01', '2020-11-17 10:29:48'),
(7, 19, 'Track records of all the activities', 'WulNwuxkVU0IrZJdH9MaHTkoGpMUtt-1603881870.jpg', 'Online marketing has the advantage of measuring and keeping all the track records. Several tools on the internet showcase record and result of your advertising operations. It not only reveals data but also shows the progress and demographics of a marketing campaign. It gives you a clear idea about the movement, leads, and sales. Moreover, you get a customized setting so that you can manage your campaigns easily.', '2020-10-28 10:44:30', '2020-10-28 10:44:30'),
(8, 19, 'Cheap and affordable', 'HooC8KE9ztd3ZawMIGZV2TdIOjt06v-1603882003.jpg', 'Apart from being convenient, marketing online is cheap and affordable. One can advertise and communicate with the customers through the internet at zero cost. Instead of advertising on newspapers, TV, and radio, you can easily advertise on the internet and contact your target audience anywhere in the world. You can also get a broad range of business directories and keep on reviewing the latest marketing trend and techniques.', '2020-10-28 10:44:57', '2020-10-28 10:46:43'),
(9, 19, 'Fast and convenient service', '1cqzKYeYzFCsLJ4IeEKczHB2azFyUl-1603881930.jpg', 'The primary advantage of online trade is that it is fast and convenient. Internet, being the speedy medium of all time, has extremely easy approachability with customers using it. Due to such an advantage, one can easily purchase any product all across the world just by sitting at home at low-cost transportation. It gives next-level experience to the consumers while shopping and give infinite alternatives for a single product.', '2020-10-28 10:45:30', '2020-10-28 10:45:30');
