(40, 25, 'aA4xAAD4Z17op3Vb4CCGxurGt', 'pharmaceutical tablets', NULL, 'pharmaceutical-tablets-GZpIDz-hkJKNO-WXyGvlM', 'subcat-64', 'Metformin is used with a proper diet and exercise program and possibly with other medications to control high blood sugar.', '<p>Metformin is used with a proper diet and exercise program and possibly with other medications to control high blood sugar. It is used in patients with type 2 diabetes. Controlling high blood sugar helps prevent kidney damage, blindness, nerve problems, loss of limbs, and sexual function problems. Proper control of diabetes may also lessen your risk of a heart attack or stroke. Metformin works by helping to restore your body\'s proper response to the insulin you naturally produce. It also decreases the amount of sugar that your liver makes and that your stomach/intestines absorb.</p>', '150', 140, '15949829801.jpg', 'No retrun policy', '', 0, '', '', NULL, 'used', '4', '', 0, 'physical', '', '', 0, 0, '8', '22', 0, 0, '', '', '2020-07-17', 1, 'no', '10', 'Piece', NULL, '2020-11-18 05:57:20'),
