(78, 59, 'nEaJhAmUrK0XEh4SMi9KrfJik', 'mahamrityunjaya', NULL, 'mahamrityunjaya', 'subcat-31', '<p>The Rudra Mantra or Mahamrityunjaya Mantra, also known as the Tryambakam Mantra, is a verse of the Rigveda. The s?kta is addressed to Tryambaka, &quot;The Three-eyed One&quot;, an epithet of Rudra. It is identified with Shiva in Shaivism.</p>', '<p>The Rudra Mantra or Mahamrityunjaya Mantra, also known as the Tryambakam Mantra, is a verse of the Rigveda. The s?kta is addressed to Tryambaka, \"The Three-eyed One\", an epithet of Rudra. It is identified with Shiva in Shaivism.</p>', 'As Per Requirement', 0, 'wtlCprNHRcQCh782xsitzk07HE17Zu-1599545359.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 1, '2020-12-30 04:58 pm', '2020-12-31 09:08 am', '2020-12-30', 1, 'no', '1', '1', '2020-09-08 06:09:19', '2020-11-18 05:57:20'),
(79, 59, 'tWwFvsShMwqDVJAlAUHZlKYgb', 'Saptashati Baglamukhi', NULL, 'saptashati-baglamukhi-IeMWVg-lzDRCT-QXptEqV', 'subcat-31', '<p><strong>Baglamukhi</strong>&nbsp;also referred to as the &ldquo;Goddess who paralyzes enemies&rdquo; is the 8th Goddess of the Das Mahavidyas in Hinduism. The word Bagala is driven from the word Valga (meaning - to rein in/bridle) Mukhi (meaning the mouth) hence having the power to silence/paralyze the enemies.</p>', '<p><strong>Baglamukhi</strong>&nbsp;also referred to as the &ldquo;Goddess who paralyzes enemies&rdquo; is the 8th Goddess of the Das Mahavidyas in Hinduism. The word Bagala is driven from the word Valga (meaning - to rein in/bridle) Mukhi (meaning the mouth) hence having the power to silence/paralyze the enemies.</p>', 'As Per Requirement', 0, 'OFXQnSYqG4tU2UDYAkySnkWAMRguci-1599545537.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '25', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1', '1', '2020-09-08 06:12:17', '2020-11-18 05:57:20'),
(80, 59, 't1HI54b4GAINHpCddUzDGKz4Q', 'Rudra abhishek', NULL, 'rudra-abhishek-bGxDni-BiRpDK-DgZUtha', 'subcat-31', '<p>On the occasion of Maha Shivratri, devotees offer &#39;<strong>Rudra</strong>-<strong>Abhishek</strong>&#39; or special ordination to the Shivling where they bathe the &#39;Shivling&#39; with different substances and each of them has a specific significance. Devotees use water, curd, sugarcane syrup, milk, honey and other things for &#39;<strong>Rudra</strong>-<strong>Abhishek</strong></p>', '<p>On the occasion of Maha Shivratri, devotees offer &#39;<strong>Rudra</strong>-<strong>Abhishek</strong>&#39; or special ordination to the Shivling where they bathe the &#39;Shivling&#39; with different substances and each of them has a specific significance. Devotees use water, curd, sugarcane syrup, milk, honey and other things for &#39;<strong>Rudra</strong>-<strong>Abhishek</strong></p>', 'As Per Requirement', 0, 'SHf1gsmYZujue18AekAIFeajycYZaT-1599545667.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '21', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1', '1', '2020-09-08 06:14:27', '2020-11-18 05:57:20'),
