(101, 71, 'zQMLvBw1p4tfMjgzKdtzAoyiW', 'Tyre Changer', NULL, 'tyre-changer-fByJzI-UemLsq-TIidUjO', 'subcat-40', '<p>Internal Clamping :- 12&quot; - 23&quot;</p>\r\n\r\n<p>Max. Tyre Dia :- 41&quot;</p>\r\n\r\n<p>Working Pressure &quot;- 8 to 10 Bar</p>', '<p>A&nbsp;<strong>tire changer</strong>&nbsp;is a&nbsp;<strong>machine</strong>&nbsp;used to help&nbsp;<strong>tire</strong>&nbsp;technicians dismount and mount&nbsp;<strong>tires</strong>&nbsp;with automobile wheels. After the wheel and&nbsp;<strong>tire</strong>&nbsp;assembly are removed from the automobile, the&nbsp;<strong>tire changer</strong>&nbsp;has all the components necessary to remove and replace the&nbsp;<strong>tire</strong>&nbsp;from the wheel.</p>', '1,05,000 - 1,35,000 Rs', 0, '6qTZAHJtySpoZ3l513YH36XeDFJpLo-1599824356.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '25', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1', 'As per Requirement', '2020-09-11 11:39:16', '2020-11-18 05:57:20'),
