(127, 83, 'xbXLcfr73tqw2mf99rWBJkeVx', 'LED Bulb', NULL, 'led-bulb-iRbgWH-WokCuE-lCNmwMp', 'subcat-68', '<p><strong>Sample:-</strong>&nbsp;Yes</p>\r\n\r\n<p><strong>Sample Policy:-</strong>&nbsp;Chargeble (As Per Quantity)</p>\r\n\r\n<p><strong>Payment Terms:-</strong>&nbsp;50%Advance &amp; 50% On Delivery</p>\r\n\r\n<p><strong>Payment Type:-</strong>&nbsp;Cash,&nbsp;Cheque,&nbsp;DD,&nbsp;Invoice,&nbsp;Bank Transfer,&nbsp;Pay&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Order,&nbsp;Online</p>\r\n\r\n<p><strong>Delivery Time:-</strong>&nbsp;1 Week</p>\r\n\r\n<p><strong>Shipment Mode :&nbsp;</strong>By Road,&nbsp;By Air,&nbsp;By Sea</p>', '<p>LED bulbs aren&rsquo;t bulbs &ndash; LED stands for &ldquo;light-emitting diode.&rdquo; They&rsquo;re tiny semiconductors (diodes) wrapped in plastic to protect the elements and focus the light. According to&nbsp;<a href=\"https://www.dictionary.com/browse/diode?s=t\" target=\"_blank\">Dictionary.com</a>, a diode is &ldquo;a semiconductor device with two terminals, typically allowing the flow of current in one direction only.&rdquo; The current comes into an anode (+) and flows out of a cathode (-). LEDs don&rsquo;t even have wire filaments like a lightbulb does.</p>', '50-150 Rs', 0, 'GFLN5X3bwar4UHFGO2VfFqLnqjg2EP-1600154872.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '54', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '200 Pieces', 'As per Requirement', '2020-09-15 07:27:52', '2020-11-18 05:57:20'),
