(168, 118, 'WXiQRsuewYqtRXfYYsw6nCcPC', 'Bougainvillea flower', NULL, 'Bougainvillea-flower-nrpYqE-JfuMSX-hNmuQxK', 'subcat-212', '<p>The&nbsp;<strong>flowers</strong>&nbsp;are generally&nbsp;<strong>small</strong>, white, and inconspicuous, highlighted by several brightly colored modified leaves called bracts.</p>', '<p>The <strong>flowers</strong> have a small, tubular, petal-like surrounding structure called the perianth—probably equivalent to the sepals in other <strong>plants</strong>—and coloured bracts (leaflike structures) that fuse and may resemble petals. In some species these bracts are like sepals and enclose a single, brightly coloured perianth whorl.</p>', '0.00', 0, 'toLcddWzDMH1c3kROVezhCi7TEzlnT-1602309915.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-11-02', 1, 'no', 'As per customer demand', 'As per customer demand', '2020-10-10 06:05:15', '2020-11-18 05:57:20'),
