(182, 125, '3cfYyNoDQX62KKUcQdTw0SKdW', 'MSME REGISTRATION', NULL, 'msme-registration-spiOrB-tvWDxy-EmCRxlr', 'subcat-219', '<p>To scale up the growing <strong>service</strong> sector in India, the government has enabled <strong>MSME registration</strong> for all <strong>service</strong> entities. Individuals/entities engaged in the delivery of <strong>services</strong> can now <strong>register</strong> as an <strong>MSME</strong> and can opt for many additional benefits introduced by the government for <strong>MSME</strong>s.</p>', '<p>To scale up the growing <strong>service</strong> sector in India, the government has enabled <strong>MSME registration</strong> for all <strong>service</strong> entities. Individuals/entities engaged in the delivery of <strong>services</strong> can now <strong>register</strong> as an <strong>MSME</strong> and can opt for many additional benefits introduced by the government for <strong>MSME</strong>s.</p>', '1500', 0, 'yY8Yg1op3MNFHspJ6U0e5Smthi9wcc-1602588956.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '21', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '10', '50', '2020-10-13 11:35:56', '2020-11-18 05:57:20'),
(183, 125, 'fO4j1E0slf2IlO3FUc13Pehtm', 'TAX & CONSULTING SERVICES', NULL, 'tax-consulting-services-yTeLZp-tFliUa-mLqPFlT', 'subcat-219', '<p>Firms or organizations which offer different kind of services are liable to pay Service Tax to the Govt. of India. Through our hands on experience and knowledge, we are able to guide and offer comprehensive consultancy services to our clients in the areas of Service Tax. If the need arises, then we back our service tax consultancy services by litigation support as well.</p>\r\n\r\n<p>Services offered are in the nature of Strategic Consulting and Advisory, Compliance Support, Litigation support and Representations and Trade Facilitation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The services offered include:</p>\r\n\r\n<p>Registration procedures</p>\r\n\r\n<p>Assistance in Refund</p>\r\n\r\n<p>Advise on Accounting</p>\r\n\r\n<p>Maintenance of Registers and Records</p>\r\n\r\n<p>Half yearly returns</p>\r\n\r\n<p>Advisory services with regard to applicability of the tax, as well as procedural compliance such as registration, assessments, to name a few</p>\r\n\r\n<p>Review of contracts and agreements to help mitigate the overall incidence of service tax</p>\r\n\r\n<p>Conducting Service tax health checks in order to determine the service tax implications on client operations, gauge compliance with legal provisions and suggest tax planning opportunities</p>', '<p>Firms or organizations which offer different kind of services are liable to pay Service Tax to the Govt. of India. Through our hands on experience and knowledge, we are able to guide and offer comprehensive consultancy services to our clients in the areas of Service Tax. If the need arises, then we back our service tax consultancy services by litigation support as well.</p>\r\n\r\n<p>Services offered are in the nature of Strategic Consulting and Advisory, Compliance Support, Litigation support and Representations and Trade Facilitation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The services offered include:</p>\r\n\r\n<p>Registration procedures</p>\r\n\r\n<p>Assistance in Refund</p>\r\n\r\n<p>Advise on Accounting</p>\r\n\r\n<p>Maintenance of Registers and Records</p>\r\n\r\n<p>Half yearly returns</p>\r\n\r\n<p>Advisory services with regard to applicability of the tax, as well as procedural compliance such as registration, assessments, to name a few</p>\r\n\r\n<p>Review of contracts and agreements to help mitigate the overall incidence of service tax</p>\r\n\r\n<p>Conducting Service tax health checks in order to determine the service tax implications on client operations, gauge compliance with legal provisions and suggest tax planning opportunities</p>', '2000', 0, 'k7LAQzRkXhiYvDGBY6GfnMed1shBvS-1602589124.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '21', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '10', '50', '2020-10-13 11:38:44', '2020-11-18 05:57:20'),
(184, 125, 'esSZXusOlyWBMBrIbhfVrX00O', 'INCOME TAX RETURN', NULL, 'income-tax-return-gjMxfQ-Wjhmqy-mGwroDK', 'subcat-219', '<p>Business Consultancy Services like <strong>Company Registration, Goods &amp; Service Tax, Trade Mark, ISO, Food License, Digital Signature Certification Service etc.</strong> to our clients. The provided services are conceptualized with client-oriented approach to bring the extreme gratification to our patrons. The offered gamut of service is rendered in obedience with the quality constraints by our very capable experts who hold rich understanding in this particular field.<br />\r\nWe have chosen an adroit team of quality supervisors that value the quality of our provided services at each stage of execution to make sure that the norms are effectively met. Moreover, we follow moral business policies and crystal pure transparency in all our transactions to keep healthy relations with the customers.</p>', '<p>Business Consultancy Services like <strong>Company Registration, Goods &amp; Service Tax, Trade Mark, ISO, Food License, Digital Signature Certification Service etc.</strong> to our clients. The provided services are conceptualized with client-oriented approach to bring the extreme gratification to our patrons. The offered gamut of service is rendered in obedience with the quality constraints by our very capable experts who hold rich understanding in this particular field.<br />\r\nWe have chosen an adroit team of quality supervisors that value the quality of our provided services at each stage of execution to make sure that the norms are effectively met. Moreover, we follow moral business policies and crystal pure transparency in all our transactions to keep healthy relations with the customers.</p>', '3500', 0, 'XaT2YoGraxMr0QkyoMq0JqPCH9vdZN-1602589324.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '21', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '10', '50', '2020-10-13 11:42:04', '2020-11-18