(204, 127, 'vxjNfJMNhXpqasRs386AtWq5h', 'T-tube led', NULL, 't-tube-led-ochtOm-BYuPWa-FZyVbWS', 'subcat-2', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Color Temperature</td>\r\n			<td>5000-6500 K</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Power Consumption</td>\r\n			<td>10W</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Brand</td>\r\n			<td>Sharp Brightness</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lighting Type</td>\r\n			<td>LED</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Input Frequency</td>\r\n			<td>50 Hz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Wattage</td>\r\n			<td>10w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Input Voltage</td>\r\n			<td>220-240 V</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Certification</td>\r\n			<td>CE</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lighting Color</td>\r\n			<td>Cool White</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '<p>Because fluorescent fixtures are often mounted into ceilings and connected directly to mains electricity, they are relatively expensive and difficult to replace completely.<br />\r\n<br />\r\nAs a result, it oftentimes makes the most economical sense to simply use the same fluorescent fixture, but replace the fluorescent tube with an LED tube light.<br />\r\n<br />\r\nTherefore, it is important to understand the types of fluorescent tubes that were developed, so that the correct LED tube light can be retrofitted in place.<br />\r\n<br />\r\nOver the years, fluorescent tube manufacturers developed many varieties of sizes and types.</p>\r\n\r\n<ul><br />\r\n	<li>T8 4-ft: Four-foot T8 fluorescent lamps are the most commonly used type today. They are 48 inches in length, and have a 1 inch lamp diameter.</li>\r\n	<br />\r\n	<li>T12 4-ft: Four-foot T12 fluorescent lamps are less efficient compared to T8 lamps. They are the same length as T8 lamps, but have a larger 1.5 inch lamp diameter.</li>\r\n	<br />\r\n	<li>T5 4-ft: Four-foot T5 fluorescent lamps are typically the most efficient, and some of the newest types of lamps introduced in the 2000&#39;s in the USA. They are commonly designated T5HO (high output) and provide more brightness than their T8 counterparts. They are slightly shorter than four feet (45.8 inches). T5 lamps come in a variety of lengths such as 1-ft, 2-ft and 3-ft versions and are commonly used in non-ceiling fixtures such as table lamps.</li>\r\n</ul>', 'As per client Requirment', 0, 'aaDyG35XD4VcirTHAMjqv2KXpT2Xiu-1602931361.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As per client Requirment', 'As per client Requirment', '2020-10-17 10:42:41', '2020-11-18 05:57:20'),
(205, 127, 'W3hEDgzpdJ3H1ZAqWjV7NA62n', 'Led tubelight', NULL, 'led-tubelight-PxmIzE-zslwcU-ZxJbrak', 'subcat-2', '<table style=\"height:248px; width:310px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Tube Base Type</td>\r\n			<td>T5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lighting Type</td>\r\n			<td>LED</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Brand</td>\r\n			<td>Sharp Brightness</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Body Material</td>\r\n			<td>Polycarbonate &amp; Aluminium</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Voltage</td>\r\n			<td>100-270 VAC</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Light Source</td>\r\n			<td>Edison, Everlight and Osram</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Power Factor</td>\r\n			<td>More Than .90</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Efficacy</td>\r\n			<td>More Than 100 lumens/Watt</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Frequency</td>\r\n			<td>50/60 Hz</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>In order to keep our offerings in safe and secure conditions, we have developed a storage unit and keep it updated with the defined industry standards. Our establishment in udaipur (India) is well connected by varied modes of transport. Thus, we are capable of reaching patrons with ease.</p>', '<p><strong>LED tube</strong> is a type of <strong>LED lamp</strong> used in <strong>fluorescent tube</strong> luminaires with G5 and G13 bases to replace traditional <strong>fluorescent tubes</strong>. As compared to <strong>fluorescent tubes</strong>, the most important advantages of <strong>LED tubes</strong> are energy efficiency and long service life.</p>', 'As per client Requirment', 0, 'BrKOyofKMQHG0hNszRcud1H4aQJ9h3-1602931656.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As per client Requirment', 'As per client Requirment', '2020-10-17 10:47:36', '2020-11-18 05:57:20'),
(206, 128, 'ar3gRXDTjDC2cAPEEIsouCYwm', 'Copper Water Bottle', NULL, 'Copper-Water-Bottle-HOAfTX-gLtvcM-zrBCTXc', 'subcat-92', '<p><em>This beautiful and unique water bottle is made of pure hammered copper. </em></p>\r\n\r\n<p><em>As a unique handmade artisan creation, your copper water bottle may have slight imperfections and vary slightly from photos shown.</em></p>', '<p><em>This beautiful and unique water bottle is made of pure hammered copper. It has been handcrafted with care and is of exceptional quality. It will last a lifetime, and, if properly cared for, multiple generations.</em></p>\n\n<p><em>The health benefits of drinking out of a copper water bottle are endless.</em></p>\n\n<p><em>Copper is anti-bacterial, acts as an effective anti-oxidant, improves immunity, supports good health, prevents aging, eliminates toxins and free radicals, and stimulates the brain.</em></p>\n\n<p><em>Since time immemorial, yogis have enjoyed water the holistic way - stored in copper vessels. Copper cannot be produced within the body and needs to be sourced from external sources.</em></p>\n\n<p><em>Our 20 oz / 600 mL copper water bottles are approximately 9 inches in height and 2.5 inches in diameter.</em></p>\n\n<p><em>Our 30 oz / 900 mL copper water bottles are approximately 10 inches in height and 2.75 inches in diameter.</em></p>\n\n<p><em>The bottles are hammered after they are made to increase the surface area that touches the water which enhances the health benefits. We also offer smooth bottles for those that prefer that aesthetic.</em></p>\n\n<p><em>As a unique handmade artisan creation, your copper water bottle may have slight imperfections and vary slightly from photos shown.</em></p>', '450', 0, 'Fxa4ZBN0hKAdu6HRZk80dbXkjxMkMQ-1602931787.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-11-02', 1, 'no', '500', '10000', '2020-10-17 10:49:47', '2020-11-18 05:57:20'),
