, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As per client Requirment', 'As per client Requirment', '2020-10-17 10:52:22', '2020-11-18 05:57:20'),
(208, 128, 'ICx5bCbCvWfttjtO42rijPM1v', 'Black Round Finish Horn Buttons', NULL, 'black-round-finish-horn-buttons-JeoOrm-OHrdtB-TWmOLlt', 'subcat-238', '<ul>\r\n	<li>Important: Every button is natural and has unique color and natural grain, that is not cracks or flaw</li>\r\n	<li>&nbsp;Rare real Buffalo horn buttons, usually used for high end men&#39;s suits or blazers</li>\r\n	<li>Eco-friendly, dry cleanable and washable</li>\r\n	<li>Natural Brown Color Real Buffalo Horn Buttons Set for men&#39;s suits and blazers</li>\r\n</ul>', '<ul>\r\n	<li>Important: Every button is natural and has unique color and natural grain, that is not cracks or flaw</li>\r\n	<li>&nbsp;Rare real Buffalo horn buttons, usually used for high end men&#39;s suits or blazers</li>\r\n	<li>Eco-friendly, dry cleanable and washable</li>\r\n	<li>Natural Brown Color Real Buffalo Horn Buttons Set for men&#39;s suits and blazers</li>\r\n</ul>', 'Rs 900/ Gross', 0, '3IyRabfbZRj64j35FYHkb0jZjT4hqC-1602932106.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '45', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 gross', '10000', '2020-10-17 10:55:06', '2020-11-18 05:57:20'),
(209, 127, '7lRn4DL8VyhdztOCDuMHSQFrB', 'led color lights', NULL, 'led-color-lights-TronkZ-Ywvbqz-iaozfbZ', 'subcat-260', '<table style=\"height:228px; width:425px\">\r\n	\r\n		<tr>\r\n			<td>Minimum Order Quantity</td>\r\n			<td>As per client requirment</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lighting Color</td>\r\n			<td>Cool Daylight</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Body Material</td>\r\n			<td>Aluminum</td>\r\n		</tr>\r\n		<tr>\r\n			<td>led outdoor spot light Power Factor</td>\r\n			<td>0.95</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Working Lifetime(Hour)</td>\r\n			<td>50000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Input Voltage(V)</td>\r\n			<td>85-265</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Brand</p>\r\n			</td>\r\n			<td>Sharp Brightness</td>\r\n		</tr>\r\n	\r\n</table>\r\n\r\n<p><br />\r\nWe are offering<strong> Outdoor LED Flood Light.</strong></p>', '<p>LEDs produce different <strong>colors</strong> by using various materials which produce photons at different wavelengths. Those individual wavelengths appear as <strong>light</strong> of different <strong>colors</strong>. ... High-brightness red and amber LEDs use the aluminum indium gallium phosphide (AlInGaP) material system.</p>', 'As per client Requirment', 0, 'QxdVPWIkfchGHk7GkBFX9ojlP1fqEF-1602932168.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-11-02', 1, 'no', 'As per client Requirment', 'As per client Requirment', '2020-10-17 10:56:08', '2020-11-18 05:57:20'),
(210, 128, 'ZmQK4yXGtsdSMkAAHdJ6c1Mfy', 'Bone Inlay Serving Tray', NULL, 'Bone-Inlay-Serving-Tray-UDyOsw-paYLWG-GnxhiCw', 'subcat-92', '<p>We take pleasure to introduce ourselves as one of the renowned organization for offering best-in-class range of&nbsp;<strong>Bone Inlay Serving Tray</strong>.</p>', '<p>We take pleasure to introduce ourselves as one of the renowned organization for offering best-in-class range of <strong>Bone Inlay Serving Tray</strong>.</p>', '1100', 0, 'OUw92Dbdk3F2BLfP34QNWEk88itYjk-1602932269.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-11-02', 1, 'no', '30', '1000', '2020-10-17 10:57:49', '2020-11-18 05:57:20'),
(211, 128, 'PVs9rz4LiVTaSyzC1uZ5YSjxX', 'Cow Ox Horn Button Blanks', NULL, 'Cow-Ox-Horn-Button-Blanks-WZEzat-lkOUnA-wfdWUoR', 'subcat-238', 'We offer our clients extensive range of finished horn buttons and buttons blanks. Horn Buttons Blanks are gaining high popularity these days due to their superior finish and high tensile strength. Owing to the expertise of our skilled professionals, we manufacture, export and supply high quality Buffalo Horn Buttons Blanks that is designed according to set industry standards. These Horn Buttons Blanks are manufactured using superior grade raw materials and advanced technology under the supervision of quality controllers. Customers can avail under supervision of quality controllers in various and designs from us', 'We offer our clients extensive range of finished horn buttons and buttons blanks. Horn Buttons Blanks are gaining high popularity these days due to their superior finish and high tensile strength. Owing to the expertise of our skilled professionals, we manufacture, export and supply high quality Buffalo Horn Buttons Blanks that is designed according to set industry standards. These Horn Buttons Blanks are manufactured using superior grade raw materials and advanced technology under the supervision of quality controllers. Customers can avail under supervision of quality controllers in various and designs from us', '2000', 0, 'GKQ1pJ9HTJ8JQMP5uuyGSxgpoxwzSW-1602932533.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-10-19', 1, 'no', '100kg', '1000', '2020-10-17 11:02:13', '2020-11-18 05:57:20'),
(212, 127, 'itr03tFFeC1WZ7ZChlC3xSjNK', 'Led Bulb', NULL, 'led-bulb-AErwZU-KyIVBX-OpTxydM', 'subcat-219', '<p>In the simplest terms, a light-emitting diode (<strong>LED</strong>) is a semiconductor device that emits light when an electric current is passed through it. Light is produced when the particles that carry the current (known as electrons and holes) combine together within the semiconductor material.</p>', '<p>What are LEDs?</p>\r\n\r\n<p><strong>L</strong>ight <strong>E</strong>mitting <strong>D</strong>iodes are basically tiny light bulbs that fit easily into an electrical circuit. They can be found in dozens of applications including digital clocks, remote controls, and traffic lights. Unlike ordinary incandescent light bulbs, LEDs do not have a filament that will burn out, so they have a much longer lifetime. LEDs are illuminated by the movement of electrons in a semiconductor material. The composition of the semiconductor affects the wavelength (color) and intensity of the emitted light. LEDs also generate much less heat and a larger percentage of the electrical current is directed toward generating light, which reduces electrical power usage.</p>', 'As per client Requirment', 0, 'xWAw02Hle1iQImO5E5DGCDXnHfxusr-1602932604.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'yes', 'As per client Requirment', 'As per client Requirment', '2020-10-17 11:03:24', '2020-11-18 05:57:20'),
(213, 129, '8Dwv5sRqJ1iqJi5oYL7iZ1fTh', 'Furniture', NULL, 'furniture-tYruBX-KlofPS-ZsSkEtn', 'subcat-219', '<p>A <strong>swivel</strong>, spinny, or <strong>revolving chair</strong> is a <strong>chair</strong> with a single central leg that allows the <strong>seat</strong> to rotate 360 degrees to the left or right.</p>', '<p>A <strong>swivel</strong>, spinny, or <strong>revolving chair</strong> is a <strong>chair</strong> with a single central leg that allows the <strong>seat</strong> to rotate 360 degrees to the left or right.</p>', 'as per client requirement', 0, 'Z4QGVig1P5qu59YmRcUZiWVn45PA9y-1602933309.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '100', '5000', '2020-10-17 11:15:10', '2020-11-18 05:57:20'),
(214, 130, '7NhzJ0r5GJHc3eyWRxAVKUwn0', 'Men T-shirt', NULL, 'men-t-shirt-DjBSOI-ZjfcKA-DKQIFmS', 'subcat-199', '<p>A T-shirt, or tee shirt, is a style of fabric shirt named after the T shape of its body and sleeves. Traditionally, it has short sleeves and a round neckline, known as a crew&nbsp;<strong>neck</strong>, which lacks a collar. T-shirts are generally made of a stretchy, light and inexpensive fabric and are easy to clean.</p>', '<p>A T-shirt, or tee shirt, is a style of fabric shirt named after the T shape of its body and sleeves. Traditionally, it has short sleeves and a round neckline, known as a crew&nbsp;<strong>neck</strong>, which lacks a collar. T-shirts are generally made of a stretchy, light and inexpensive fabric and are easy to clean.</p>', 'As Per Requirement', 0, 'P7kgrr2X7NhyNt9kmwdgnleenjZuWC-1603091740.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 07:15:40', '2020-11-18 05:57:20'),
(215, 130, 'rulqXW3ZySJxd12ZDNqFIrvzL', 'Men Polo T-shirt', NULL, 'men-polo-t-shirt-dXnuiF-HKdVwq-zPyEWfH', 'subcat-199', '<p>A&nbsp;<strong>polo shirt</strong>, by definition, has a collar, a placket with two or three buttons, and sometimes a pocket. Also known as a golf&nbsp;<strong>shirt</strong>&nbsp;and a tennis&nbsp;<strong>shirt</strong>, the&nbsp;<strong>polo shirt</strong>&nbsp;has its roots in tennis. ... Ralph Lauren, catching on&nbsp;<strong>to</strong>&nbsp;the popularity of the style, used a&nbsp;<strong>polo shirt</strong>&nbsp;as the foundation of his fashion line in 1972</p>', '<p>A&nbsp;<strong>polo shirt</strong>, by definition, has a collar, a placket with two or three buttons, and sometimes a pocket. Also known as a golf&nbsp;<strong>shirt</strong>&nbsp;and a tennis&nbsp;<strong>shirt</strong>, the&nbsp;<strong>polo shirt</strong>&nbsp;has its roots in tennis. ... Ralph Lauren, catching on&nbsp;<strong>to</strong>&nbsp;the popularity of the style, used a&nbsp;<strong>polo shirt</strong>&nbsp;as the foundation of his fashion line in 1972</p>', 'As Per Requirement', 0, '9Tc8OFc7blMxg1H9322xv7PplrGU5U-1603092379.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 07:26:19', '2020-11-18 05:57:20'),
