(228, 131, 'QRFkBAcgdG6Ph1ZpxwkSDPxx7', 'kurti', NULL, 'kurti-GvmUQS-BeVDCg-RiFvHwE', 'subcat-200', '<p>In modern usage, a short kurta is referred to as the&nbsp;<strong>kurti</strong>, which is the attire of females. However, traditionally, the term&nbsp;<strong>kurti</strong>&nbsp;refers to waist coats, jackets and blouses which sit above the waist without side slits, and are believed to have descended from the tunic of the Shunga period (2nd century B.C.).</p>', '<p>In modern usage, a short kurta is referred to as the&nbsp;<strong>kurti</strong>, which is the attire of females. However, traditionally, the term&nbsp;<strong>kurti</strong>&nbsp;refers to waist coats, jackets and blouses which sit above the waist without side slits, and are believed to have descended from the tunic of the Shunga period (2nd century B.C.).</p>', 'As Per Requirement', 0, '0xz2o5xjiq6uLUmM6cTmXkk2Dsx8Rc-1603103086.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 10:24:47', '2020-11-18 05:57:20'),
