(235, 90, 'ej4PnFjxlUpBJxBaRq0ZbI9Cd', 'RUBBER NETI', NULL, 'rubber-neti-ZzRSXM-ikqdSD-YHDaqlV', 'subcat-92', '<p>Sutra Neti requires the insertion of a thread or a special type of rubber tube into the nostril in a way that it comes out of the mouth. This thread then dislodges mucous and debris and helps clear the nasal passages. It is also thought that common problems such as nasal polyps could be removed by this method.</p>', '<p>Sutra Neti requires the insertion of a thread or a special type of rubber tube into the nostril in a way that it comes out of the mouth. This thread then dislodges mucous and debris and helps clear the nasal passages. It is also thought that common problems such as nasal polyps could be removed by this method.</p>', 'As Per Requirement', 0, 'kPW2Wvhp3QfzGCymC8mEw8bZiwMUmo-1603108191.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 11:49:51', '2020-11-18 05:57:20'),
(236, 90, 'Zk15XaBLa2G7uQE9dELFZtHfL', 'SUTRA NETI', NULL, 'sutra-neti-FZWcod-PDpKxS-YhexbUy', 'subcat-92', '<p>Sutra neti along with jalneti has the power to cure all nasal related disorders like sinusitis, blockage of nasal passage, etc. It massages the membranes and sinus glands thereby strengthening them. It is also good for nose and throat, tonsillitis and catarrh.</p>', '<p>Sutra neti along with jalneti has the power to cure all nasal related disorders like sinusitis, blockage of nasal passage, etc. It massages the membranes and sinus glands thereby strengthening them. It is also good for nose and throat, tonsillitis and catarrh.</p>', 'As Per Requirement', 0, 'OIILkS3wW0oO7BNfAz45ogObl3A2N2-1603108437.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 11:53:57', '2020-11-18 05:57:20'),
(237, 90, 'XxVjt4ix8J2uT0Oj0UXkgLmzz', 'STEAM INHALER ALL IN ONE (ACTIVE)', NULL, 'steam-inhaler-all-in-one-active-VHphiO-iTIfmc-pEtwAvO', 'subcat-2', '<p>so called steam therapy, it involves the inhalation of water vapor. The warm, moist air is thought to work by loosening the mucus in the nasal passages, throat, and lungs. This may relieve symptoms of inflamed, swollen blood vessels in your nasal passages</p>', '<p>so called steam therapy, it involves the inhalation of water vapor. The warm, moist air is thought to work by loosening the mucus in the nasal passages, throat, and lungs. This may relieve symptoms of inflamed, swollen blood vessels in your nasal passages</p>', 'As Per Requirement', 0, 'oJtNAk4OmXu0oTSwTQNAUG0egoGQxh-1603108588.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-19 11:56:28', '2020-11-18 05:57:20'),
