(252, 136, 'BfkHIEg3zcOmevSRVUNMjoEoD', 'kurti', NULL, 'kurti-vHUZxC-Bblecp-DZuoyhJ', 'subcat-2', '<p>&nbsp;</p>\r\n\r\n<p>In modern usage, a short kurta is referred to as the&nbsp;<strong>kurti</strong>, which is the attire of females. However, traditionally, the term&nbsp;<strong>kurti</strong>&nbsp;refers to waist coats, jackets and blouses which sit above the waist without side slits, and are believed to have descended from the tunic of the Shunga period.</p>', '<p>In modern usage, a short kurta is referred to as the&nbsp;<strong>kurti</strong>, which is the attire of females. However, traditionally, the term&nbsp;<strong>kurti</strong>&nbsp;refers to waist coats, jackets and blouses which sit above the waist without side slits, and are believed to have descended from the tunic of the Shunga period.</p>', '150', 0, 'lFTSxiBxIw91HkIt48BRVgDoHRH0OF-1603180961.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '21', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1000', '100000', '2020-10-20 08:02:44', '2020-11-18 05:57:20'),
