(254, 77, 'GMdEyVEKNGbGQdVSuKNXbVhhK', 'Oyster Mushroom', NULL, 'oyster-mushroom-SLjghX-NMvQjb-uNnWODK', 'subcat-208', '<p>The&nbsp;<strong>oyster mushrooms</strong>&nbsp;have three distinct parts- a fleshy shell or spatula shaped cap (pileus) , a short or long lateral or central stalk called stipe and long ridges and furrows underneath the pileus called gills or lamellae. The gills stretch from the edge of the cap down to the stalk and bear the spores.</p>', '<p>The&nbsp;<strong>oyster mushrooms</strong>&nbsp;have three distinct parts- a fleshy shell or spatula shaped cap (pileus) , a short or long lateral or central stalk called stipe and long ridges and furrows underneath the pileus called gills or lamellae. The gills stretch from the edge of the cap down to the stalk and bear the spores.</p>', 'As Per Requirement', 0, 'xN3d7sqlHsvuIYNhVyzTjFe3jh9Pai-1603184029.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '35', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '500kg', 'As Per Requirement', '2020-10-20 08:53:49', '2020-11-18 05:57:20'),
(255, 77, 'gWxhyjxsUpC5nyoQT6zx8uoUO', 'Dry Mushroom', NULL, 'dry-mushroom-lJYZbA-qzmLUA-VzGwryj', 'subcat-208', '<p><strong>Dried Mushrooms</strong>&nbsp;are&nbsp;<strong>mushrooms</strong>&nbsp;that have been deliberately&nbsp;<strong>dried</strong>&nbsp;in order to preserve them. Both wild and cultivated&nbsp;<strong>mushrooms</strong>&nbsp;are available&nbsp;<strong>dried</strong>. ... When&nbsp;<strong>drying</strong>&nbsp;fresh&nbsp;<strong>mushrooms</strong>&nbsp;yourself, you end up to a 10 to 1 ratio: 10 pounds (4.5 kg) of fresh&nbsp;<strong>mushrooms</strong>&nbsp;equals 1 pound (450g) of&nbsp;<strong>dried</strong>.</p>', '<p><strong>Dried Mushrooms</strong>&nbsp;are&nbsp;<strong>mushrooms</strong>&nbsp;that have been deliberately&nbsp;<strong>dried</strong>&nbsp;in order to preserve them. Both wild and cultivated&nbsp;<strong>mushrooms</strong>&nbsp;are available&nbsp;<strong>dried</strong>. ... When&nbsp;<strong>drying</strong>&nbsp;fresh&nbsp;<strong>mushrooms</strong>&nbsp;yourself, you end up to a 10 to 1 ratio: 10 pounds (4.5 kg) of fresh&nbsp;<strong>mushrooms</strong>&nbsp;equals 1 pound (450g) of&nbsp;<strong>dried</strong>.</p>', 'As Per Requirement', 0, '7hoI3fRLDpuNo7AbAzjzaNnzjm52RJ-1603184542.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '59', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:02:22', '2020-11-18 05:57:20'),
(256, 77, 'G0Kbaoh0VmfRDvsBkMqS9tlgD', 'Milky Mushroom', NULL, 'milky-mushroom-UWtRLy-qMYbBR-DbsexqO', 'subcat-208', '<p><strong>Milky mushrooms</strong>&nbsp;are medium to large in size with rounded caps averaging 10-14 centimeters in diameter that connect to an elongated, thick stem. The smooth, firm caps are convex when young, flattening out with age, and remain pure white through maturity</p>', '<p><strong>Milky mushrooms</strong>&nbsp;are medium to large in size with rounded caps averaging 10-14 centimeters in diameter that connect to an elongated, thick stem. The smooth, firm caps are convex when young, flattening out with age, and remain pure white through maturity</p>', 'As Per Requirement', 0, 'TfAjO7unN8YdfpEsPAOemggDbTaDJl-1603184884.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '59', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:08:04', '2020-11-18 05:57:20'),
(257, 77, 'GYTF1KS1Ma8beRYgs3e4Olbf8', 'White Mushroom', NULL, 'white-mushroom-MecPUQ-Ydtcwx-mYaNqUF', 'subcat-208', '<p><strong>White</strong>&nbsp;button&nbsp;<strong>mushrooms</strong>&nbsp;are small to medium in size with caps averaging 2-7 centimeters in diameter and are attached to short, truncated stems. The smooth&nbsp;<strong>white</strong>&nbsp;caps are rounded, firm, and spongy. When bruised, the&nbsp;<strong>white</strong>&nbsp;flesh will turn light pink and will then transform into brown</p>', '<p><strong>White</strong>&nbsp;button&nbsp;<strong>mushrooms</strong>&nbsp;are small to medium in size with caps averaging 2-7 centimeters in diameter and are attached to short, truncated stems. The smooth&nbsp;<strong>white</strong>&nbsp;caps are rounded, firm, and spongy. When bruised, the&nbsp;<strong>white</strong>&nbsp;flesh will turn light pink and will then transform into brown</p>', 'As Per Requirement', 0, 'qpeKO2pnwGIWP6orXmrjZVJOrvMlzz-1603185515.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '59', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:18:35', '2020-11-18 05:57:20'),
(258, 77, '8LmaiGQVTflaaGSJqbZWpwDIm', 'Portobello Mushroom', NULL, 'portobello-mushroom-VCAqdy-Hlsjfb-WLKJIUv', 'subcat-208', '<p><strong>Portobello mushrooms</strong>&nbsp;(also referred to as portabello and portobella) are simply the fully mature version of cremini&nbsp;<strong>mushrooms</strong>. These large, dark brown&nbsp;<strong>mushrooms</strong>&nbsp;have an open cap, with visible, deep brown gills on the underside</p>', '<p><strong>Portobello mushrooms</strong>&nbsp;(also referred to as portabello and portobella) are simply the fully mature version of cremini&nbsp;<strong>mushrooms</strong>. These large, dark brown&nbsp;<strong>mushrooms</strong>&nbsp;have an open cap, with visible, deep brown gills on the underside</p>', 'As Per Requirement', 0, 'rj03IFeVxvZBkVaoskp3BP3WTGJOiL-1603186370.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '35', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:32:50', '2020-11-18 05:57:20'),
(259, 77, 'qC2T13suCpQu8wi3ja1LthKgE', 'Shiitake Mushroom', NULL, 'shiitake-mushroom-ykmFLY-dnRfQX-VFdpCuD', 'subcat-208', '<p><strong>Shiitake mushrooms</strong>&nbsp;are small to medium in size with caps averaging 10-20 centimeters in diameter and are attached to thin stems. The caps range in color from light to dark brown and have a wide, umbrella shape with a characteristic curled rim. Inside, the cream-colored flesh is firm, chewy, and spongy</p>', '<p><strong>Shiitake mushrooms</strong>&nbsp;are small to medium in size with caps averaging 10-20 centimeters in diameter and are attached to thin stems. The caps range in color from light to dark brown and have a wide, umbrella shape with a characteristic curled rim. Inside, the cream-colored flesh is firm, chewy, and spongy</p>', 'As Per Requirement', 0, 'zZ8JSVk9iCsQw6iKe9YLTfYEceWWkc-1603186671.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '59', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:37:51', '2020-11-18 05:57:20'),
(260, 77, 'SzpINP3k2AxCDULBd8vqQRhOV', 'Enoki Mushroom', NULL, 'enoki-mushroom-EzCKWL-FhNKoD-iWXocHr', 'subcat-208', '<p>a whitish cultivated agaric&nbsp;<strong>mushroom</strong>&nbsp;(Flammulina velutipes synonym Collybia velutipes) with a long thin stem and a small cap</p>', '<p>a whitish cultivated agaric&nbsp;<strong>mushroom</strong>&nbsp;(Flammulina velutipes synonym Collybia velutipes) with a long thin stem and a small cap</p>', 'As Per Requirement', 0, 'sAr1FOUJhc6EqrRgDkLlJp9I2W4xjM-1603186764.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '35', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:39:24', '2020-11-18 05:57:20'),
(261, 77, 'mutc01LbIUM3YvJtAd1aB6416', 'Shimeji Mushroom', NULL, 'shimeji-mushroom-FiMKYQ-OIQlmg-SxrfVKe', 'subcat-208', '<p><strong>Shimeji</strong>&nbsp; is a group of edible&nbsp;<strong>mushrooms</strong>&nbsp;native to East Asia, but also found in northern Europe. Hon-<strong>shimeji</strong>&nbsp;(Lyophyllum&nbsp;<strong>shimeji</strong>) is a mycorrhizal fungus and difficult to cultivate. ...&nbsp;<strong>Shimeji</strong>&nbsp;is rich in umami tasting compounds such as guanylic acid, glutamic acid, and aspartic acid</p>', '<p><strong>Shimeji</strong>&nbsp; is a group of edible&nbsp;<strong>mushrooms</strong>&nbsp;native to East Asia, but also found in northern Europe. Hon-<strong>shimeji</strong>&nbsp;(Lyophyllum&nbsp;<strong>shimeji</strong>) is a mycorrhizal fungus and difficult to cultivate. ...&nbsp;<strong>Shimeji</strong>&nbsp;is rich in umami tasting compounds such as guanylic acid, glutamic acid, and aspartic acid</p>', 'As Per Requirement', 0, '9F8S3UQD4fO0ocIoBIZRIP2n7GZvqp-1603187042.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '59', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'As Per Requirement', 'As Per Requirement', '2020-10-20 09:44:02', '2020-11-18 05:57:20'),
