(326, 151, 'aC8mYhpRqkusf8giFPJ7FkQjL', 'coconut oil', NULL, 'coconut-oil-yvrpnl-jJxdlp-vrFRQoZ', 'subcat-358', '<p><strong>Coconut oil</strong>, or copra <strong>oil</strong>, is an edible <strong>oil</strong></p>', '<p><strong>Coconut oil</strong>, or copra <strong>oil</strong>, is an edible <strong>oil</strong> extracted from the kernel or meat of mature <strong>coconuts</strong> harvested from the <strong>coconut</strong> palm (Cocos nucifera). It has various applications.</p>', '450', 0, 'gDmSAXgcpInybO968dQvrV3RR3kjHF-1603338413.png', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', '', NULL, 0, 0, '', '', 0, 0, '', '', '2020-11-02', 1, 'no', '10', '1000', '2020-10-22 03:46:53', '2020-11-18 05:57:20'),
(327, 151, 'Ir2F2OK8HEkknhTyj5MigZ7IR', 'hair coconut oil', NULL, 'hair-coconut-oil-qzycTo-HocEfP-IuxZUXQ', 'subcat-2', '<p>It offers long and strong <strong>hair</strong>. It prevents <strong>hair</strong> fall and promotes the growth of <strong>hair</strong>.</p>', '<p>It offers long and strong <strong>hair</strong>. It prevents <strong>hair</strong> fall and promotes the growth of <strong>hair</strong>. Massaging the scalp with this <strong>oil</strong> for few minutes helps in attaining lustrous and healthy <strong>hair</strong>. Regular use of Parachute <strong>Coconut Oil</strong> protects the <strong>hair</strong> from the damage caused by sun and other pollutants.</p>', '500', 0, 'VXeP1cyEgyEdg3V74BI9B1JsXdPJ7a-1603338878.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '38', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '25', '2000', '2020-10-22 03:54:38', '2020-11-18 05:57:20'),
(328, 152, 'G3SQvs6zsJ5SFV1T8Gv05Tm9r', 'Dehydrated White Onion Granules', NULL, 'dehydrated-white-onion-granules-MyksDC-XySYTG-gdBujDF', 'subcat-219', '<h3>Product Details:</h3>\r\n\r\n<ul>\r\n	<li>Style Dried</li>\r\n	<li>Shelf Life 18 Months</li>\r\n	<li>Processing Form Other</li>\r\n	<li>Dehydration Method onion granules</li>\r\n	<li>Drying Process Food Dehydrators</li>\r\n	<li>Supply Ability : 100 Kilograms Per Day</li>\r\n</ul>', '<p>Dehydrated White Onion Granules are often used in spice blends, packaged meats, canned and frozen foods. These granules are mainly used in preparation of soups, sauces, frozen foods, salad dressings, meat products and other food products whenever onion flavour or taste is required. These granules are highly appreciated in the market and widely used too. Dehydrated White Onion Granules are prepared by making use of the best quality dehydrated white onion at our best hygienic place. These granules are particularly applied in vegetables &amp; meat preparations, gravies, sauces, seasoning salad dressings, cheese, crackers etc. these are very effective as well as economical to use.</p>\r\n\r\n<p><br />\r\n<strong>Dehydrated Onion red &amp; White Granules&nbsp;</strong></p>\r\n\r\n<p>MOISTURE CONTENT&nbsp;&nbsp;&nbsp; 6% max<br />\r\nHOT WATER INSOLUBLE&nbsp;&nbsp;&nbsp; 20% max<br />\r\nASH CONTENT&nbsp;&nbsp;&nbsp; 4% max<br />\r\nACID INSOLUBLE ASH&nbsp;&nbsp;&nbsp; 0.5% max</p>', '60 INR/Kilograms', 0, '32RQuBxcywHLZFizlxO5leoTaI5Are-1603343751.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '24', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 Ton Kilograms', 'As per order', '2020-10-22 05:15:51', '2020-11-18 05:57:20'),
(329, 152, 'JBYR5GYMGi3YqzWaiWJ6RMQaU', 'Dehydrated Garlic Powder', NULL, 'dehydrated-garlic-powder-PypURX-tZfczX-nHLitOl', 'subcat-219', '<ul>\r\n	<li>Style Other</li>\r\n	<li>Shelf Life 12 Months</li>\r\n	<li>Processing Form Other</li>\r\n	<li>Dehydration Method dehydrated Galic powder</li>\r\n	<li>Drying Process Food Dehydrators</li>\r\n	<li>Supply Ability : 1000 Kilograms Per Day</li>\r\n</ul>', '<p>Dehydrated Garlic Powder is an important ingredient in the spices blends as well as dry rub. This powder is used as seasoning in meat, veggies and also as an addition in snacks like popcorn, and roasted nuts. This powder is also used for regulating the blood sugar levels. Dehydrated Garlic Powder has a smooth, fine texture which helps to ensure the flavour of garlic to get distributed throughout the dish in an evenly manner. This powder has multiple of medicinal properties which helps in lowering the cholesterol level, heart disease, thinning of blood, and also blocking the growth of cancer cells.</p>\r\n\r\n<p><br />\r\n<br />\r\nColor Brownish Size Up to 100 mesh Quality A Grade, B Grade, Commercial Grade Packing10/15/20 Kg Net weight in natural white poly bag inside double layer strong paper bag.Origin Gujarat,India<br />\r\n<br />\r\nPackaging Type&nbsp;&nbsp;&nbsp; Loose Packing<br />\r\nPackaging Size&nbsp;&nbsp;&nbsp; 20-40Kg<br />\r\nMoisture&nbsp;&nbsp;&nbsp; 0.5%<br />\r\nForm&nbsp;&nbsp;&nbsp; Powder<br />\r\nStorage Instruction&nbsp;&nbsp;&nbsp; Cool and Dry Place<br />\r\nShelf Life&nbsp;&nbsp;&nbsp; 6 Months<br />\r\n&nbsp;</p>', '70 INR/Kilograms', 0, 'X6X8ZC4MBQEaM3uH8jufXGrN2avpg3-1603343898.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '24', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 Ton Kilograms', 'As per order', '2020-10-22 05:18:18', '2020-11-18 05:57:20'),
(330, 152, 'YIuSVjLtsoyj5KYPU5PIGQj36', 'Fresh Red Onion', NULL, 'fresh-red-onion-jqUHCt-PQntRC-IPHQFcL', 'subcat-219', '<ul>\r\n	<li>Style other</li>\r\n	<li>Shape Natural</li>\r\n	<li>Processing Form Raw</li>\r\n	<li>Shelf Life 03-05 Week</li>\r\n	<li>Supply Ability : 1000 Ton Per Day</li>\r\n</ul>', '<p>Our provided range of <strong>Fresh Onion</strong> is used as main ingredients in salads and it strong flavour smell makes any dish delicious. It is rich in fiber which ensures good digestive system. is used in daily cooking as a flavoring agent, curry base and adds to the body of any gravy or sauce. It also makes for a great complement in grizzled or caramelized form. We deliver this <strong>Fresh Onion</strong> in well-packed bags to assure convenience in handling and long time storage.</p>\r\n\r\n<p><strong>Other Details:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Organic: Yes</li>\r\n	<li>Size: Small, Medium Large</li>\r\n	<li>Origin: India&nbsp;</li>\r\n	<li>Uses: Cooking, Hotel, Household, etc.&nbsp;</li>\r\n	<li>Note: Price varies as per order quantity and market rates.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '12 INR/Kilograms', 0, 'z5DbSysMIXo22AkHk57QsXVn1aEudb-1603343971.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '24', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 Ton Kilograms', 'As per order', '2020-10-22 05:19:31', '2020-11-18 05:57:20'),
