(353, 127, 'BGnWMyna4EMTUxg2XCqLL4l6i', 'Led Bulb', NULL, 'led-bulb-HzTtYD-VGFNbY-VlBYiAa', 'subcat-260', '<p>n the simplest terms, a light-emitting diode (<strong>LED</strong>) is a semiconductor device that emits light when an electric current is passed through it. Light is produced when the particles that carry the current (known as electrons and holes) combine together within the semiconductor material.</p>', '<p>What are LEDs?</p>\r\n\r\n<p><strong>L</strong>ight <strong>E</strong>mitting <strong>D</strong>iodes are basically tiny light bulbs that fit easily into an electrical circuit. They can be found in dozens of applications including digital clocks, remote controls, and traffic lights. Unlike ordinary incandescent light bulbs, LEDs do not have a filament that will burn out, so they have a much longer lifetime. LEDs are illuminated by the movement of electrons in a semiconductor material. The composition of the semiconductor affects the wavelength (color) and intensity of the emitted light. LEDs also generate much less heat and a larger percentage of the electrical current is directed toward generating light, which reduces electrical power usage.</p>', 'as per order', 0, 'zdZjT06gb4MOIHrRkyU71AXSeo0rtY-1603369244.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-10-22 12:20:44', '2020-11-18 05:57:20'),
