(371, 163, '71ixO12ib3hF8OjJ80wIQDpKr', '9w led bulb', NULL, '9w-led-bulb-rItUsZ-VJkAdK-iatqgwT', 'subcat-260', '<p>the simplest terms, a light-emitting diode (LED) is a semiconductor device that emits light when an electric current is passed through it. Light is produced when the particles that carry the current (known as electrons and holes) combine together within the semiconductor material.</p>', '<p>What are LEDs?</p>\r\n\r\n<p><strong>L</strong>ight <strong>E</strong>mitting <strong>D</strong>iodes are basically tiny light bulbs that fit easily into an electrical circuit. They can be found in dozens of applications including digital clocks, remote controls, and traffic lights. Unlike ordinary incandescent light bulbs, LEDs do not have a filament that will burn out, so they have a much longer lifetime. LEDs are illuminated by the movement of electrons in a semiconductor material. The composition of the semiconductor affects the wavelength (color) and intensity of the emitted light. LEDs also generate much less heat and a larger percentage of the electrical current is directed toward generating light, which reduces electrical power usage.</p>', 'As per market price', 0, 'WSsRDTu65Cii0NqojUv6PzBkRCL0D6-1603456059.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, 1, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-10-23 12:27:39', '2020-11-18 05:57:20'),
