(489, 195, 'SJSv20ZDqYQZiugQ4cnYURgbb', 'napkin ring,', NULL, 'napkin-ring-mKQbCe-iKoMIf-xHEOLIa', 'subcat-232', '<p>The <strong>napkin ring</strong>, occasionally called a Christening bangle, was originally <strong>used to</strong> identify the <strong>napkins</strong> of a household between weekly wash days. The standard <strong>napkin ring</strong> is a simple <strong>ring</strong> made from skewers.</p>', '<p>a <strong>ring</strong> or band of metal, wood, plastic, etc., through which a folded <strong>napkin</strong> is inserted, often as part of a place setting.</p>', '320', 0, 'zNLGZdWEwrmocT9XxBd0gX0IELDDSd-1604303363.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '48', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 07:49:24', '2020-11-18 05:57:20'),
(490, 195, 'fRV5O1L3Dt3T8snvf5Wb8qYhr', 'Ear rings', NULL, 'ear-rings-zyueWP-JMjoEH-kEKsOSV', 'subcat-232', '<p>Through the years, <strong>earrings</strong> are a symbol of womanhood and a sign of identification. Women are known to wear them since ancient times. The earlobe is associated with financial stability and social status.</p>', '<p>An <strong>earring</strong> is jewelry you wear on your ear. Your favorite <strong>earrings</strong> might be tiny white pearls, or they might be long feathers that dangle to your shoulders. An <strong>earring</strong> is any kind of ring, stud, hoop, or dangling decoration that you clip on your earlobe or hook through a hole pierced in your ear.</p>', 'as per order', 0, 'bfF4QwubcCTemrhtx9Z3F6XqbtPxgJ-1604303548.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '48', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 07:52:28', '2020-11-18 05:57:20'),
(491, 195, '5DdEktyO3wUMApPLucKMuGza8', 'Christmas decore', NULL, 'christmas-decore-rVwWfD-GsUPJH-QljtRBE', 'subcat-232', '<p>Pagans used branches of it to <strong>decorate</strong> their homes during the winter solstice, as it made them think of the spring to come. The Romans used Fir Trees to <strong>decorate</strong> their temples at the festival of Saturnalia. Christians use it as a sign of everlasting life with God.</p>', '<p>A <strong>Christmas decoration</strong> is any of several types of ornamentation used at Christmastime and the greater holiday season. The traditional colors of <strong>Christmas</strong> are pine green (evergreen), snow white, and heart red. ... Gold and silver are also very common, as are other metallic colours</p>', 'as per order', 0, 'gTmNHsaBBtvpfXmpx2hnnnd0N5Kyzj-1604303756.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '48', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 07:55:56', '2020-11-18 05:57:20'),
(492, 195, 'IqtvLBqcUaMrHXXskqEQqeB2W', 'bracelet', NULL, 'bracelet-EIjdAF-FIgElz-ldzJagp', 'subcat-232', '<p>Here are some adjectives for <strong>bracelet</strong>: shiny virgin, flat segmented, golden spiral, death-magical, certain death-magical, broad rosy, massive and repulsive, magnificent serpentine, new opal, medical alert, huge and remarkable, loose, loose, clumsy and unornamental, handsome jeweled, antique opal, shiny electronic, old ...</p>', '<p>A <strong>bracelet</strong> is an article of jewellery that is worn around the wrist. ... When it is worn around the ankle it is called an ankle <strong>bracelet</strong> or anklet. A boot <strong>bracelet</strong> is used to decorate boots. Colloquially, handcuffs are sometimes called <strong>bracelets</strong>.</p>', '320', 0, 'XJOLTRxoxJ8HydMyrNeC5KmccgqhDp-1604303849.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '47', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 07:57:29', '2020-11-18 05:57:20'),
(493, 195, 'TqoMaQf7Ab42chm5YjrLNsJB1', 'Beaded purse', NULL, 'beaded-purse-KeFoNh-CJLnQj-jsyaIzu', 'subcat-232', '<p>From 1900 to 1918 one of the more popular styles was the <strong>beaded handbag</strong>. This small <strong>bag</strong>, about the size of a grapefruit or smaller, was made of fabric that was covered in small beads.</p>', '<p>In the late <strong>nineteenth century</strong>, beaded purses became hugely popular. This is due to the world becoming more mobile with the Industrial Revolution. Women needed a way to carry their possessions around with them.</p>', 'as per order', 0, 'Zj2p0ZDIpbcVgh3SuagG84Y5OKTVib-1604303953.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '48', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 07:59:13', '2020-11-18 05:57:20'),
(494, 195, 't4h81mV0Z0jErSh1Pbo9km6XK', 'Light decore', NULL, 'light-decore-eOlxKJ-aDJkjw-ULKCxsm', 'subcat-270', '<p>Lighting is the foundation to our vision, the most powerful of our senses. Light is visible radiant <strong>energy</strong>, revealing our world in all its shapes and colors to us. Electric light came into existence around 1880 with the development of the carbon <strong>filament</strong> light bulb.</p>', '<p><strong>Decorative lighting</strong> is the fourth layer of interior illumination and, simply put, it is like jewelry for the home: it helps your space sparkle and shine. ... Note that sometimes, <strong>decorative</strong> fixtures can also serve other purposes, like task or accent <strong>lighting</strong>. That just makes <strong>decorative</strong> fixtures even more versatile.</p>', 'as per order', 0, 'Dm4o8Azy1TOIEKFqPQ8GdWtE9kdVr5-1604304095.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '23', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-02 08:01:35', '2020-11-18 05:57:20'),
