(540, 209, 'eYXwmvYovXLnuEuNYNKRBM6Wo', 'grapes', NULL, 'grapes-xUKZwpv', 'subcat-209', '<ul>\r\n	<li>BUSINESS TYPE Exporter, Importer, Supplier, Trading Company</li>\r\n	<li>EMPLOYEE COUNT 25</li>\r\n	<li>ESTABLISHMENT 1995</li>\r\n	<li>WORKING DAYSMonday To Sunday</li>\r\n</ul>', '<p>An Overview There is no denying in the point that unsustainable farm practices lead to global issues such as soil erosion and loss of biodiversity. Therefore, with the increase in population, the necessity of shifting towards a sustainable approach is also increasing. Considering the same, we, NORI ENTERPRISES IMPORTER &amp; EXPORTER , came into existence and began producing an assortment of fresh vegetables and fruits using sustainable farming methods. Fresh Brinjal and Green Grapes are few of our organically grown consumables that we offer millions. Being a reliable producer in the agricultural field, we only follow organic farming techniques for producing our fruits and vegetables. We are a team of talented and experienced farmers who keep a check over our crops with utmost care to ensure higher and quality yield without the use of any chemical fertilizers, pesticides&nbsp;</p>', '100', 0, 'DiuGgRHBXP35gFCUe2GhSOdytbx7sd-1604569719.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '42', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '10', '100', '2020-11-05 09:48:39', '2020-12-01 09:30:47'),
