(577, 213, 'kPYgDmNjQsPqkEemIqo4479gc', 'mustard sauce', NULL, 'mustard-sauce-DStPlh-kgzMnG-xcuVeaM', 'subcat-361', '<p><strong>Mustard</strong> is often <strong>used at</strong> the table as a condiment on meat. It is also <strong>used as</strong> an ingredient in mayonnaise, vinaigrettes.</p>', '<p><strong>Mustard sauces</strong> usually come as a thick paste, and are <strong>used</strong> either as a dipping <strong>sauce</strong> or in stir frying. Ideal for breaded and fried foods, barbecue, hamburgers, tacos, rice, etc. <strong>Mustard</strong> is often <strong>used at</strong> the table as a condiment on meat. It is also <strong>used as</strong> an ingredient in mayonnaise, vinaigrettes.</p>', '000', 0, 'XJHzenoky8FpRf1hjmnzBQ8AyAWB2L-1604635548.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '000', '000', '2020-11-06 04:05:48', '2020-11-18 05:57:20'),
(578, 213, 'iv9jcFOgMIFSeTt9Jc45qFAbG', 'vinegar', NULL, 'vinegar-WHGQbM-ISRxGB-EQxcCZd', 'subcat-361', '<p><strong>Vinegar</strong> is an aqueous solution of acetic acid and trace chemicals that may include flavorings.</p>', '<p><strong>Vinegar</strong> is an aqueous solution of acetic acid and trace chemicals that may include flavorings. <strong>Vinegar</strong> typically contains 5&ndash;8% acetic acid by volume. Usually the acetic acid is produced by the fermentation of ethanol or sugars by acetic acid bacteria. There are many types of <strong>vinegar</strong>, depending on source materials.</p>', '000', 0, 'YnjgHhzGTF1RN4YPjKFeUku9MXfkE1-1604635661.jpeg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '000', '000', '2020-11-06 04:07:41', '2020-11-18 05:57:20'),
