(922, 285, 'KJOcKY0CqImeZA469MSmouZ4s', 'Ajwain', NULL, 'ajwain-kGpJOPF', 'subcat-197', '<p><strong>Ajwain</strong> (Trachyspermum ammi L. Sprague) is an annual aromatic and herbaceous plant of the family Apiaceae. It is an erect annual herb with a striate stem and originated in the eastern regions of Persia and India. Its fruits are small, and grayish-brown in color</p>', '<p><strong>Ajwain</strong> (Trachyspermum ammi L. Sprague) is an annual aromatic and herbaceous plant of the family Apiaceae. It is an erect annual herb with a striate stem and originated in the eastern regions of Persia and India. Its fruits are small, and grayish-brown in color</p>', '00', 0, '5eYSgwzwFuhlIG4wXVKuMtabE7CXzi-1606117260.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 ton', 'as per customer demand', '2020-11-23 07:41:08', '2020-11-23 07:41:08'),
(923, 285, 'UHDcBi1wZPqsm4vNXCB7ijqBg', 'Black cardamom', NULL, 'black-cardamom-DfTYEWV', 'subcat-197', '<p><strong>Black cardamom</strong> is the fragrant pods of one of two species of Amomum. ... Both varieties of <strong>black cardamom</strong> have a strong smoky aroma owing to the way the pods are dried over fire. Because of this unique fragrance, they are almost always used in savoury dishes.</p>', '<p><strong>Black cardamom</strong> is the fragrant pods of one of two species of Amomum. ... Both varieties of <strong>black cardamom</strong> have a strong smoky aroma owing to the way the pods are dried over fire. Because of this unique fragrance, they are almost always used in savoury dishes.</p>', '00', 0, 'vkeU5ktDJTrI6r2339dbN8jSzq1wG6-1606117505.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 ton', 'as per customer demand', '2020-11-23 07:45:05', '2020-11-23 07:45:05'),
(924, 285, 'SGgHqaROwMZAGmHWXLvafaPDu', 'mace javitri', NULL, 'mace-javitri-zMvhSfH', 'subcat-197', '<p><strong>Javitri</strong> is a crimson red colored thread like material that envelops the nutmeg. It is spicy in taste, somewhat like a combination of pepper and cinnamon, with a strong aroma. <strong>Javitri</strong> is the net like extra seed covering that covers the Nutmeg&#39;s seed coat.</p>', '<p><strong>Javitri</strong> is a crimson red colored thread like material that envelops the nutmeg. It is spicy in taste, somewhat like a combination of pepper and cinnamon, with a strong aroma. <strong>Javitri</strong> is the net like extra seed covering that covers the Nutmeg&#39;s seed coat.</p>', '00', 0, 'bJdtyoKXzyslsYZTSol7AZcHcJOp0g-1606117745.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 ton', 'as per customer demand', '2020-11-23 07:49:17', '2020-11-23 07:49:17'),
(925, 288, '6JZBFRQ0EoJNPK25ChfHuI8qx', 'Almond nuts', NULL, 'almond-nuts-Lepvudg', 'subcat-210', '<p><strong>Almonds</strong>&nbsp;are the edible seeds of Prunus dulcis, more commonly called the&nbsp;<strong>almond</strong>&nbsp;tree. ... The&nbsp;<strong>almonds</strong>&nbsp;you can buy in stores usually have the shell removed, revealing the edible&nbsp;<strong>nut</strong>&nbsp;inside.</p>', '<p><strong>Almonds</strong>&nbsp;are the edible seeds of Prunus dulcis, more commonly called the&nbsp;<strong>almond</strong>&nbsp;tree. ... The&nbsp;<strong>almonds</strong>&nbsp;you can buy in stores usually have the shell removed, revealing the edible&nbsp;<strong>nut</strong>&nbsp;inside.</p>', '00', 0, 'QPoXveEqiIw3qcMoci5EyAz8vBHV30-1606131718.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 TON', 'AS PER CUSTOMER DEMAND', '2020-11-23 11:41:58', '2020-11-23 11:41:58'),
(926, 288, 'Ck9HcasuRWpbtso8f91UymEVz', 'Cashew nut', NULL, 'cashew-nut-WDSLmfk', 'subcat-210', '<p><strong>Cashew nut</strong>&nbsp;is made up of a fruit in which the kernel is embedded. The real fruit of the&nbsp;<strong>cashew</strong>&nbsp;is commonly a&nbsp;<strong>nut</strong>. It is a kidney- or heart-shaped achene, in any normal variety. Its color varies from bottle green to grayish brown (dried fruit).</p>', '<p><strong>Cashew nut</strong>&nbsp;is made up of a fruit in which the kernel is embedded. The real fruit of the&nbsp;<strong>cashew</strong>&nbsp;is commonly a&nbsp;<strong>nut</strong>. It is a kidney- or heart-shaped achene, in any normal variety. Its color varies from bottle green to grayish brown (dried fruit).</p>', '00', 0, 'pIlCCKlHoWLKQ51c1dEwA9up3Npr8L-1606131837.', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '', '', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '1 TON', 'AS PER CUSTOMER DEMAND', '2020-11-23 11:43:57', '2020-11-23 11:43:57'),
