(928, 289, 'pFM54wvS4xdHpJN7PVDt3ROin', 'Oyster Mushroom', NULL, 'oyster-mushroom-xgQlVyi', 'subcat-208', '<p><strong>Oyster mushroom</strong>&nbsp;is the rich source of protein, vitamins, minerals, fibre and other antioxidants like selenium protect body cells from damage that might lead to chronic diseases and help to strengthen the immune system.</p>', '<p>The&nbsp;<strong>oyster mushrooms</strong>&nbsp;have three distinct parts- a fleshy shell or spatula shaped cap (pileus) , a short or long lateral or central stalk called stipe and long ridges and furrows underneath the pileus called gills or lamellae. The gills stretch from the edge of the cap down to the stalk and bear the spores.</p>', 'As Per requirement', 0, '8XtOWgbMFwMqgbYlHIEg7RWma1qUaX-1606132229.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '35', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', '100 Kg', 'As Per Requirement', '2020-11-23 11:50:29', '2020-11-23 11:50:29'),
