(994, 299, 'KlDET2oJ6ksVxZMcSIxX5u947', 'kids cloths', NULL, 'kids-cloths-xjPSZNg', 'subcat-201', '<p><strong>Children&#39;s</strong>&nbsp;clothing or&nbsp;<strong>kids</strong>&#39; clothing is clothing for&nbsp;<strong>children</strong>&nbsp;who have not yet grown to full height. ...&nbsp;<strong>Children&#39;s</strong>&nbsp;clothing is often more casual than adult clothing, fit for play and rest. Hosiery is commonly used.</p>', '<p><strong>Children&#39;s</strong>&nbsp;clothing or&nbsp;<strong>kids</strong>&#39; clothing is clothing for&nbsp;<strong>children</strong>&nbsp;who have not yet grown to full height. ...&nbsp;<strong>Children&#39;s</strong>&nbsp;clothing is often more casual than adult clothing, fit for play and rest. Hosiery is commonly used. More recently, however, a lot of childrenswear is heavily influenced by trends in adult fashion.</p>', 'as per order', 0, 'INOPOJ9hrh8ZhZW0LkxTloJjKanHQb-1606541539.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '49', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-28 05:32:19', '2020-11-28 05:32:19'),
(995, 299, 'dF0Iulwg0cwUDTuXBvNxi2fDr', 'Leggings', NULL, 'leggings-KUQbmuY', 'subcat-200', '<p><em>Leggings</em>&nbsp;are a type of skin-tight clothing covering the legs, which can be worn by both men and women.</p>', '<p><strong>Leggings</strong>&nbsp;refer to several types of leg coverings. Modern usage from the 1960s has come to refer to elastic close-fitting garments worn over the legs typically by women, such as leg warmers or&nbsp;<strong>tights</strong>.</p>', 'as per order', 0, 'CUg7s3X1ojenfgp5PPhU5wqcZ2DFpu-1606541697.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-28 05:34:57', '2020-11-28 05:34:57'),
(996, 299, 'MuU60fv9XiaBsW9cgoel0pP8y', 'polo with pocket', NULL, 'polo-with-pocket-fCPHBtT', 'subcat-199', '<p>A&nbsp;<strong>T</strong>-<strong>shirt</strong>, or&nbsp;<strong>tee shirt</strong>, is a style of fabric&nbsp;<strong>shirt</strong>&nbsp;named after the&nbsp;<strong>T</strong>&nbsp;shape of its body and sleeves.</p>', '<p>A&nbsp;<strong>T</strong>-<strong>shirt</strong>, or&nbsp;<strong>tee shirt</strong>, is a style of fabric&nbsp;<strong>shirt</strong>&nbsp;named after the&nbsp;<strong>T</strong>&nbsp;shape of its body and sleeves. Traditionally, it has short sleeves and a round neckline, known as a crew neck, which lacks a collar.&nbsp;<strong>T</strong>-<strong>shirts</strong>&nbsp;are generally made of a stretchy, light and inexpensive fabric and are easy to clean.</p>', 'as per order', 0, 'BtXQtkPZzEzO24tZit74WRbXJTRvEI-1606541879.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-28 05:37:59', '2020-11-28 05:37:59'),
(997, 299, 'PkwmxRejZ2mL2TiZocHzwyWRY', 'kids shorts set', NULL, 'kids-shorts-set-BVbatou', 'subcat-201', '<p><strong>Children&#39;s clothing</strong>&nbsp;or&nbsp;<strong>kids</strong>&#39;&nbsp;<strong>clothing</strong>&nbsp;is&nbsp;<strong>clothing</strong>&nbsp;for&nbsp;<strong>children</strong>&nbsp;who have not yet grown to full height.</p>', '<p><strong>Children&#39;s clothing</strong>&nbsp;or&nbsp;<strong>kids</strong>&#39;&nbsp;<strong>clothing</strong>&nbsp;is&nbsp;<strong>clothing</strong>&nbsp;for&nbsp;<strong>children</strong>&nbsp;who have not yet grown to full height. Grandma bait is a retail industry term for expensive&nbsp;<strong>children&#39;s clothing</strong>.&nbsp;<strong>Children&#39;s clothing</strong>&nbsp;is often more casual than adult&nbsp;<strong>clothing</strong>, fit for play and rest. Hosiery is commonly used.</p>', 'as per order', 0, 'ho7zAMQhjb9GMtQjceBe9u5pLSBGkb-1606542076.jpg', NULL, NULL, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, 'physical', NULL, NULL, 0, 0, '8', '50', 0, 0, NULL, NULL, '0000-00-00', 1, 'no', 'as per order', 'as per order', '2020-11-28 05:41:16', '2020-11-28 05:41:16'),
