ruited our team after checking their working experiences and knowledge. We are able to deliver the products on time at client destination with the help of our well-connected distribution network.<br />\r\n<br />\r\nUnder the inspiring guidance of our owner, &ldquo;<strong>Mr. Vimal&nbsp; Maurya&#39;</strong>, we have created a benchmark in the competitive industry. He has vast experience in this domain and helps us to offer quality products to our respected clients at reasonable prices. We have developed a cordial relationship with our valued clients across the nation.</p>', '9628350614', NULL, NULL, 'Manufacturer', 'Upto 10 People', NULL, 'Individual - Proprietor', 'Upto Rs. 50 Lakh', NULL, 'Wholesaler,Distributor', 'Individual - Proprietor', 'Manufacturer', NULL, NULL, NULL, NULL, NULL, 'fMZIWHve1wb8kPHEqwcrWgqaZ', NULL, 0, '$2y$10$TecibZ7E49w0/ilxj5g2ouGb55SF3fiIzUxBsIYMDKc/TiPTWour2', 1, '', 0, 0, NULL, '2020-10-21 17:46:49', '2020-10-21 18:06:15', 'no', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
