ientele in North 24 Parganas and other cities of West Bengal as well. Moreover, we provide all our services at reasonable charges.</p>', '7477546905', NULL, NULL, 'Manufacturer', 'Upto 10 People', 2017, 'Individual - Proprietor', 'Upto Rs. 50 Lakh', 'wCFpOLvAdOMPfNET13mS7L1T6PdXaf-1603438551.jpeg', 'Wholesaler,Distributor,Supplier,Manufacturer,Retailer', 'Individual - Proprietor', 'Manufacturer', NULL, NULL, NULL, NULL, NULL, '2dEEj0ehRitELfMULeLAgVrpS', NULL, 0, '$2y$10$4zC.qrxO0cPo5P6ZTHeG4Oybfu3378FVN.AMdJpGQyS/Oe/agFrQa', 1, '', 0, 0, NULL, '2020-10-23 14:20:18', '2020-10-23 14:35:51', 'no', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
