(221, NULL, NULL, 'Prashant', 'Prash', 'prashantdasari143@gmail.com', NULL, 'customer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '105', NULL, NULL, NULL, 'Solapur, Maharashtra', 105, 3, 50, NULL, '7420904343', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'FlEHTDyYRweEBKDCsTY9lslpp', NULL, 0, '$2y$10$RSFwwdMickBslXRsPtESHeppmFjJpwccduOkeEavZyan4UPf3ptkS', 1, '', 0, 0, NULL, '2020-11-06 19:30:14', '2020-11-06 19:30:14', 'no', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(223, NULL, NULL, 'Sagar Patil', 'SagarPatil', 'patil.sagar717@gmail.com', NULL, 'vendor', 'theme-2', 'Honesty International', NULL, 'Nagaraj galli,', '9764484094', '9764484094', NULL, '416229', NULL, 'sagar patil', 'ceo', 'A/p-Nagaraj galli, Varange, Tal-Karveer, Dist-Kolhapur 416229, Karveer, Kolhapur, Maharashtra, India - 416229', 'Varange', 'Nagaraj galli,', NULL, '105', NULL, NULL, NULL, 'A/p-Nagaraj galli, Varange, Tal-Karveer, Dist-Kolhapur 416229, Karveer, Kolhapur, Maharashtra, India - 416229 Varange Nagaraj galli, - 416229', 105, 3, 53, '<p>One of the most celebrated names in the industry, Honesty International is a company that is involved in providing an extensive range of jaggery products. We are a remarkable manufacturer and supplier of jaggery products such as jaggery cubes, pure sugarcane jaggery, and organic jaggery. The jaggery products are manufactured with the best quality sugarcane and other raw materials, which are procured directly from our certified and highly trustworthy vendors. We check the final product on diverse quality parameters before dispatching them to our customers. Our products are delivered to our customers in a safe and timely manner. Customers can purchase these jaggery products from us at the most affordable prices. Our distribution network has been expanded to various jaggery markets across diverse locations within India.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Honesty International is one of the distinguished enterprises that are engaged in the business of manufacturing and supplying a wide range of high quality sugarcane and jaggery products. The company has been headquartered in Pune (Maharashtra, India). Mr. Sagar Patil (Owner) is the brilliant mind behind the establishment of our company. He laid the foundation stone of the firm in the year 2019.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Our Manufacturing Base</strong></p>\r\n\r\n<p>We have a widespread and well-equipped manufacturing base, which helps us in finishing