(269, NULL, NULL, 'satish gupta', 'satish123', 'satish_gupta020@rediffmail.com', NULL, 'vendor', 'theme-1', 'Roochida Spices Private Limited', NULL, 'Amravati', '8087555597', '8087555597', 'satish_gupta020@rediffmail.com', NULL, NULL, 'satish gupta', 'owner', 'C-3, Saturna Industrial Estate, Badnera Road, Amravati-444605, Maharashtra, India', 'C-3, Saturna Industrial Estate, Badnera Road, Amravati-444605, Maharashtra, India', 'Amravati', NULL, '105', '', NULL, NULL, 'C-3, Saturna Industrial Estate, Badnera Road, Amravati-444605, Maharashtra, India C-3, Saturna Industrial Estate, Badnera Road, Amravati-444605, Maharashtra, India Amravati - ', 105, 3, 51, '<blockquote>\r\n<h2>Roochida Spices Private Limited</h2>\r\n\r\n<p>Established in the year&nbsp;<strong>1979</strong>, we,&nbsp;<strong>Roochida Spices Private Limited</strong>, are well known recognized firm engaged in manufacturing and supplying various types Spices and Papads. Our vast experience of 30 years in this industry has helped us gain the experience and expertise to manufacture high quality products, timely delivery of the products, ways and means to achieve maximum client satisfaction and how to offer all these products at affordable prices. We understand and believe that ultimately the growth and success of any organization is through customer satisfaction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are a value based industry with high ethical policies. Our honest approach and integrated technologies assist us in producing products with quintessence quality. Valued services and innovative technologies are identified by our customers who have developed trust and confidence in our products. We are environment friendly industry and offer least resistance in the environment around our production plant.</p>\r\n</blockquote>', '8087555597', NULL, '27AAACR7709N1ZW', 'Manufacturer', 'Upto 10 People', 1979, 'Individual - Proprietor', 'Upto Rs. 50 Lakh', NULL, 'Manufacturer', 'Individual - Proprietor', 'Manufacturer'