(311, '', '', 'Mr. Feerose', 'HAPPYWHOLESELLING', 'Sales@happywholeselling.com', NULL, 'vendor', 'theme-1', 'HAPPY WHOLESELLING', NULL, 'Bhagawanpur', '8594990522', NULL, NULL, '751019', 'APQPG4174C', 'Mr. Feerose', 'Proprietor', 'Brindavan Garden Apa. K9 B', 'Kalinga Nagar', NULL, 'http://www.happywholeselling.co.in', '105', NULL, NULL, NULL, 'Brindavan Garden Apa. K9 B Kalinga Nagar  - 751019', 105, 31, 2887, '<p>Happy Wholeselling is counted amongst the leading names in the fashion industry of Bhubaneswar. We are involved in manufacturing, supplying and exporting best-in-class men&rsquo;s wear, ladies wear, kids wear, men&rsquo;s footwear and ladies slipper. Our men&rsquo;s wear includes sports jacket, men&rsquo;s innerwear, men&rsquo;s jeans, men&rsquo;s shirts and men&rsquo;s t shirts. Our men&rsquo;s wear is widely known for its alluring patterns, fine stitching and availability in different designs. Our ladies wear includes ladies shrug, designer kurtis, designer skirts and ladies innerwear. Our ladies wear is liked and worn by the ladies of all age groups. Moreover, our specialization in providing kid&rsquo;s wear, men&rsquo;s footwear and ladies slipper has made us more popular in the industry. Customers can dial the numbers that flash on our official website to connect with us. We are offering our products at the most affordable prices.<br />\r\n<br />\r\nHappy Wholeselling is a Bhubaneswar (Odisha, India) based company, which has been able to become a notable name under the expert guidance of Mr. Feerose (company founder). The company is operating in the industry since 2018.<br />\r\n<br />\r\n<strong>Major Markets</strong><br />\r\nWe have a huge client base in Bhubaneswar. There are many clients in the city, who have approached us to purchase our products. We also export our products to various famous international markets worldwide as well.<br />\r\n<br />\r\n<strong>Our Team</strong><br />\r\nOur team comprises some of the most dedicated stitching experts and craftsmen, who are working in this domain for many years now. They have in-depth knowledge and experience to design the best quality products in a quick time.</p>', '8594990522', NULL, '21APQPG4174C1Z7', 'Manufacturer', 'Upto 10 People', NULL, 'Individual - Proprietor', 'Rs. 5 Lakh - 20 Lakh', 'gZlbWu6pEA2SkWUWgGisXPAPcdFVqo-1606894016.jpg', 'Wholesaler,Supplier,Retailer', 'Individual - Proprietor', 'Manufacturer', NULL, NULL, NULL, NULL, NULL, 'EvypC8DUXfqdjxHFYVkVZhLYU', NULL, 0, '$2y$10$fNWuQOIF8cMR2mCYD5fXU.yX0RJcwtiJORBKkiNqUsB1Fpz1J1jxy', 1, '', 0, 0, NULL, '2020-12-02 13:51:13', '2020-12-02 14:26:56', 'no', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
