(335, '', '', 'Mr.Nilesh Charvekar', 'Nilesh321', 'charwekar.nilesh.s@gmail.com', NULL, 'vendor', 'theme-2', 'GLOBAL TRADERS', NULL, 'Manmad', '8805121647', NULL, NULL, '423104', NULL, ' ', 'owner', 'opposite Arihant Marbal', 'chandwad road', NULL, NULL, '105', NULL, NULL, NULL, 'opposite Arihant Marbal chandwad road  - 423104', 105, 3, 2302, '<p><strong>Customer Focused &amp; Retention Practices</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Being future focused and to attain our success dreams, we pay special attention on satisfying customers. We have hired a special quality controlling team, which has been given responsibility of ensuring that fresh and pure food products&nbsp;<em><strong>Crystal White Salt, Pearl Millet, Fresh Potato, White Salt, Pomegranate, Red Onion, etc.&nbsp;</strong></em>are delivered by us to customers. The transaction process of money is also made simpler by us for customers as we give multiple payment options. Our timeliness in orders delivery, reasonable pricing policy and zeal to know opinion of customers related to products &amp; policies are further helping us grow in the business-line.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Why Us?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There are many companies in the domain that are offering similar products like&nbsp;&nbsp;<em><strong>Pearl Millet, Fresh Potato, White Salt, Pomegranate, Red Onion, etc.</strong></em>&nbsp;still we are getting the maximum number of orders due to our several attributes some of them have been cited below:</p>\r\n\r\n<ul>\r\n	<li>We have a specialized bunch of industry&#39;s personnel for handling our day to day operations.</li>\r\n	<li>We strictly abide by the Government rules and regulations for running business.&nbsp;</li>\r\n	<li>We value time and ensure to deliver orders of our customers within the promised deadline.&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Reliable Vendor Base</strong></p>\r\n\r\n<p>We are blessed to have reliable and reputed manufacturing firms as our partners who have always supported us by supplying high grade agro products to us. They also helps us in fulfilling our clients bulk and urgent needs on time. With the help of our proficient procurement agents, we are able to select some of the trustworthy producers on the grounds of their past record, achievements, market reputation, financial stability, etc. We are looking forward to make our bond more stronger and long-term which are beneficial for all of us.</p>', '8805121647', NULL, NULL, 'Manufacturer', 'Upto 10 People', NULL, 'Individual - Proprietor', 'Upto Rs. 5 Lakh', 'XdSHMOFzr7Mo5nsrN5A0TD3okiwtSJ-1608544862.jpg', 'Exporter,Supplier,Importer,Manufacturer,Trader', 'Individual - Proprietor', 'Manufacturer', NULL, NULL, NULL, NULL, NULL, 'FhoyFv2ySUyuTJxkVUOrb6Q0h', NULL, 0, '$2y$10$wX9RzUZQhHGReAC/wnKD3.Ps3dVRwllxvhgt3ZceW/AKaAjMe4Q/.', 1, '', 0, 0, NULL, '2020-12-21 16:08:34', '2020-12-21 17:31:20', 'no', NULL, '', NULL, NULL, NULL, NULL, 'CBIN0283311', '3305395297', '3305395297', 'Saving', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
